INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (589, '0321826132', '9780321826138', 'College Algebra with Modeling & Visualization', 2014, 10, 5, 1, 2, '8-1/2\" x 10-7/8\"', '900', '2012-12-21 00:00:00', 'By connecting applications, modeling, and visualization, Gary Rockswold motivates students to learn mathematics in the context of their experiences. In order to both learn and retain the material, students must see a connection between the concepts and their real lives. In this new edition, connections are taken to a new level with “See the Concept” features, where students make important connections through detailed visualizations that deepen understanding.\n \nRockswold is also known for presenting the concept of a function as a unifying theme, with an emphasis on the rule of four (verbal, graphical, numerical, and symbolic representations). A flexible approach allows instructors to strike their own balance of skills, rule of four, applications, modeling, and technology.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (590, '0132898357', '9780132898355', 'Mathematics for Business', 2014, 21, 5, 1, 3, '8-1/2\" x 10-7/8\"', '928', '2012-12-21 00:00:00', 'For courses in business mathematics at the freshman/sophomore levels.\n \nMathematics for Business provides practical, up-to-date coverage of the mathematical techniques students must master to succeed in business today. Covering more algebra than competing books, it looks at a range of topics such as payroll records, inflation and the time value of money, range and standard deviation and index numbers. Examples and problems relate to real world events and personal finance issues so material is relevant to students. This tenth edition is supported by MyMathLab, includes over 150 new problems, uses Apple as a case study illustration, and addresses the global financial crisis and personal debt.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (591, '0321825535', '9780321825537', 'Basic College Mathematics', 2014, 11, 5, 1, 3, '8-1/2\" x 10-7/8\"', '832', '2012-12-21 00:00:00', 'The Support You Need to Succeed…Even On the Go!\n \nThe Lial Series has helped thousands of students succeed in developmental mathematics by providing the best learning and teaching support to students and instructors. With the new editions, the approachable writing and pedagogy, varied exercise sets, and robust ancillary resources have been updated.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (592, '0321845056', '9780321845054', 'Essential Math 4e', 2014, 11, 5, 1, 3, '8-1/2\" x 10-7/8\"', '464', '2012-12-21 00:00:00', 'The Support You Need to Succeed…Even On the Go!\n \nThe Lial Series has helped thousands of students succeed in developmental mathematics by providing the best learning and teaching support to students and instructors. With the new editions, the approachable writing and pedagogy, varied exercise sets, and robust ancillary resources have been updated. A tightly integrated MyMathLab course, new Lial Video Library, and fresh, interactive PowerPoint slides meet the changing needs of today’s students and instructors…even on the go!', 1);
