INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (594, '0321874226', '9780321874221', 'Elementary Algebra:  Concepts & Applications', 2014, 11, 5, 4, 2, '8-1/2\" x 10-7/8\"', '672', '2012-12-21 00:00:00', 'The Bittinger Concepts and Applications Program delivers proven pedagogy, guiding students from skills-based math to the concepts-oriented math required for college courses. The new editions support students with a tightly integrated MyMathLab course (access kit available separately), quality applications and exercises, and a new MyMathGuide workbook and video program (available separately).\n \nTeaching and Learning Experience\nTo provide a better teaching and learning experience for both instructors and students, this program will:\nImprove Results: MyMathLab delivers proven results in helping students succeed and provides engaging experiences that personalize learning.\nTeach Conceptual Understanding: Proven pedagogy, robust exercise sets, and end—of-chapter material are all geared towards ensuring students grasp the concepts.\nGuide Students’ Learning: The new Bittinger video program and MyMathGuide work hand in hand to guide students to success.\n \n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (595, '0321848284', '9780321848284', 'Intermediate Algebra: Concepts & Applications', 2014, 11, 5, 1, 2, '8-1/2\" x 10-7/8\"', '794', '2012-12-21 00:00:00', 'Objective: Skills to Concepts\n \nThe Bittinger Concepts and Applications Program delivers proven pedagogy, guiding students from skills-based math to the concepts-oriented math required for college courses. The new editions support students with a tightly integrated MyMathLab course (access kit available separately), quality applications and exercises, and a new MyMathGuide workbook and video program (available separately).\n \nTeaching and Learning Experience\nTo provide a better teaching and learning experience for both instructors and students, this program will:\nImprove Results: MyMathLab delivers proven results in helping students succeed and provides engaging experiences that personalize learning.\nTeach Conceptual Understanding: Proven pedagogy, robust exercise sets, and end—of-chapter material are all geared towards ensuring students grasp the concepts.\nGuide Students’ Learning: The new Bittinger video program and MyMathGuide work hand in hand to guide students to success.\n ', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (596, '0321900472', '9780321900470', 'Precalculus: A Unit Circle Approach', 2014, 10, 5, 1, 2, '8-1/2\" x 10-7/8\"', '960', '2012-12-21 00:00:00', 'Ratti and McWaters wrote this series with the primary goal of preparing students to be successful in calculus. Having taught both calculus and precalculus, the authors saw firsthand where students would struggle, where they needed help making connections, and what material they needed in order to succeed in calculus. Their experience in the classroom shows in each chapter, where they emphasize conceptual development, real-life applications, and extensive exercises to encourage a deeper understanding. Precalculus: A Unit Circle Approach, Second Edition, offers the best of both worlds: rigorous topics and a friendly, “teacherly” tone.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (597, '0321870484', '9780321870483', 'Introductory Algebra 10', 2014, 11, 5, 1, 3, '8-1/2\" x 10-7/8\"', '784', '2012-12-21 00:00:00', 'The Lial Series has helped thousands of students succeed in developmental mathematics by providing the best learning and teaching support to students and instructors.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (598, '0321826035', '9780321826039', 'Introductory & Intermediate Algebra 3e', 2014, 11, 5, 1, 3, '9\" x 10-7/8\"', '978', '2012-12-21 00:00:00', 'The Akst/Bragg series’ success is built around clear and concise writing, a side-by-side “teach by example” approach, and integrated applications throughout that help students achieve conceptual understanding. The user-friendly design offers a distinctive side-by-side format that pairs examples and their solutions with corresponding practice exercises. Students understand from the very beginning that doing math is an essential part of learning it. Motivational, real-world applications demonstrate how integral mathematical understanding is to a variety of disciplines, careers, and everyday situations.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (599, '032174747X', '9780321747471', 'Analysis with an Introduction to Proof', 2014, 11, 5, 1, 2, '7-3/8\" x 9-1/8\"', '380', '2012-12-22 00:00:00', 'For courses in undergraduate Analysis and Transition to Advanced Mathematics.\n \nAnalysis with an Introduction to Proof, Fifth Edition helps fill in the groundwork students need to succeed in real analysis—often considered the most difficult course in the undergraduate curriculum. By introducing logic and emphasizing the structure and nature of the arguments used, this text helps students move carefully from computationally oriented courses to abstract mathematics with its emphasis on proofs. Clear expositions and examples, helpful practice problems, numerous drawings, and selected hints/answers make this text readable, student-oriented, and teacher- friendly.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (600, '0321817621', '9780321817624', 'Statistical Reasoning for Everyday Life', 2014, 3, 5, 1, 3, '8-1/2\" x 10-7/8\"', '600', '2012-12-28 00:00:00', 'Statistical Reasoning for Everyday Life, Fourth Edition, provides students with a clear understanding of statistical concepts and ideas so they can become better critical thinkers and decision makers, whether they decide to start a business, plan for their financial future, or just watch the news. The authors bring statistics to life by applying statistical concepts to the real world situations, taken from news sources, the internet, and individual experiences.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (603, '0321825276', '9780321825278', 'Intro Stats', 2014, 3, 5, 1, 2, '8-1/2\" x 10-7/8\"', '768', '2012-12-29 00:00:00', 'Richard De Veaux, Paul Velleman, and David Bock wrote Intro Stats with the goal that students and instructors have as much fun reading it as they did writing it. Maintaining a conversational, humorous, and informal writing style, this new edition engages students from the first page.\n \nThe authors focus on statistical thinking throughout the text and rely on technology for calculations. As a result, students can focus on developing their conceptual understanding. Innovative Think/Show/Tell examples give students a problem-solving framework and, more importantly, a way to think through any statistics problem and present their results.\n \nNew to the Fourth Edition is a streamlined presentation that keeps students focused on what’s most important, while including out helpful features. An updated organization divides chapters into sections, with specific learning objectives to keep students on track. A detailed table of contents assists with navigation through this new layout. Single-concept exercises complement the existing mid- to hard-level exercises for basic skill development.\n \nThis text is also available with MyStatLab™­—please see the Features section or visit www.mystatlab.com for more information.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (604, '0321838203', '9780321838209', 'Calculus and Its Applications Expanded Version', 2014, 9, 5, 1, 2, '8-1/2\" x 10-7/8\"', '984', '2012-12-31 00:00:00', 'This is an expanded version of Calculus and its Applications, Tenth Edition, by Bittinger, Ellenbogen, and Surgent. This edition adds coverage of trigonometric functions, differential equations, sequences and series, probability distributions, and matrices. \n \nCalculus and Its Applications has become a best-selling text because of its accessible presentation that anticipates student needs. The writing style is ideal for today’s students, providing intuitive explanations that build on students’ earlier mathematical experiences. Explanations are often coupled with figures to help students visualize new calculus concepts. Additionally, the text’s numerous and up-to-date applications from business, economics, life sciences, and social sciences help motivate students. Algebra diagnostic and review material is available for those who need to strengthen basic skills. Every aspect of this text is designed to motivate and help students to more readily understand and apply the mathematics.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (607, '0133083500', '9780133083507', 'Basic Technical Mathematics', 2014, 11, 5, 1, 2, '8-1/2\" x 10-7/8\"', '796', '2013-01-02 00:00:00', 'For courses in Introductory Technical Math.  \n \nThis tried-and-true text from Allyn Washington preserves the author\'s highly regarded approach to technical math, while enhancing the integration of technology. Appropriate for a one- to two-semester course, BASIC TECHNICAL MATHEMATICS shows how algebra and trigonometry are used on the job. It addresses a vast number of technologies including aeronautics, construction, energy, environmental, electronics, computer design, automotive, fire science and more! Known for its exceptional problem sets and applied material, the book offers practice exercises, writing exercises, word problems, and practice tests. This edition features more technical applications, over 1300 new exercises, additional graphing calculator screens, and a robust MyMathLab online homework course.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (608, '0133116530', '9780133116533', 'Basic Technical Mathematics with Calculus', 2014, 9, 5, 1, 2, '8-1/2\" x 10-7/8\"', '1,192', '2013-01-02 00:00:00', 'For courses in Introductory Technical Math.\n \nThis tried-and-true text from Allyn Washington preserves the author\'s highly regarded approach to technical math, while enhancing the integration of technology. Appropriate for a two- to three- semester course, BASIC TECHNICAL MATHEMATICS WITH CALCULUS shows how algebra, trigonometry, and basic calculus are used on the job. It addresses a vast number of technical and pre-engineering fields, including computer design, electronics, solar energy, lasers fiber optics, and the environment. Known for its exceptional problem sets and applied material, the book offers practice exercises, writing exercises, word problems, and practice tests. This edition features more technical applications, over 2300 new exercises, additional graphing calculator screens, and a robust MyMathLab online homework course.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (609, '0205850251', '9780205850259', 'Writing for Life: Paragraphs and Essays, 3E', 2014, 20, 5, 1, 3, '8-1/2\" x 10-7/8\"', '720', '2013-01-04 00:00:00', 'The revolutionary approach of D.J. Henry’s Writing for Life offers a visually rich, high-interest, and down-to-earth approach that reinforces the writing process while showing students how to take responsibility for their learning.\n \nWhile the areas-for-learning are often steadfast, today’s developing writers learn differently than learners from 10, 15, 20 years ago. The overwhelming majority of today’s learners—having been influenced by television, interacted with the Web, and watched video games—are products of an environment where information is presented and ideas are expressed principally through visuals. D.J. Henry recognized the differences between today’s learners and learners of yesteryear, and wrote Writing for Life from the ground up to address the thinking and learning processes occurring today.\n \nThe ground-breaking design of Writing for Life (developed in conjunction with Dorling Kindersley Publishers [DK]) makes writing, reading and thinking processes visible, and shows the processes rather than just telling students about them. Highly graphic layouts and unique visual pedagogy empower students to transfer the learning strategies they already use in interpreting the visual world to the task of writing. This visual approach—created specifically for today’s visually-oriented learners-is complemented by the student-centered learning strategy called “What’s the Point?” Not only does \"What\'s the Point?\" demonstrate real-world scenarios or applications of writing in context, but this directed thinking activity also prompts students to set a learning goal, call on prior knowledge, predict information, focus on structure, and generate details for each writing lesson. Thus, the visual approach and the “What\'s the Point?” theme of Writing for Life inspire student-centered learning and motivation by illustrating the power of writing in life.\n \nThis edition of Writing for Life: Paragraphs and Essays is supported by an enhanced MyWritingLab course, which offers text-specific exercises within the Learning Path, all of which feed into the MyWritingLab Gradebook.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (610, '0321860470', '9780321860477', 'Cornerstones for College Success', 2014, 33, 5, 1, 3, '8-1/2\" x 10-7/8\"', '416', '2013-01-04 00:00:00', 'For First Year Experience, Student Success, and Introduction to College courses.\n \nWritten specifically for students attending four year programs, Cornerstones for College Success addresses the needs and challenges of today\'s college students. \n \nCornerstones is known for its\' concrete and practical strategies that students can apply to all college classes, the world of work, and life in general, and addresses the \"why\" of learning and the power of positive change. Offers hallmark coverage of Bloom\'s taxonomy, SQ3R integration, Information and Financial literacy. Major defining topics include first generation students, adult learners, making successful transitions, and planning for success in the second year and beyond. The ancillary materials are designed to assist instructors in delivering a top-level student success course.\n \nTECHNOLOGY OFFERING: MyStudentSuccessLab is available upon request. It is an online solution designed to help students ‘Start strong, Finish stronger’ by building skills for ongoing personal and professional development. Go to http://mystudentsuccesslab.com/mssl3 for a Point and Click DEMO. \n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (611, '0321860594', '9780321860590', 'Cornerstones for Community College Success, 2/E', 2014, 33, 5, 4, 3, '8-1/2\" x 10-7/8\"', '384', '2013-01-04 00:00:00', 'For First Year Experience, Student Success, and Introduction to College courses.\n \nWritten specifically for students attending two year programs, Cornerstones for Community College Success addresses the needs and challenges of students in community and technical colleges. \n \nKnown for its concrete and practical strategies that students can apply to all college classes, the world of work, and life in general, it addresses the \"why\" of learning and the power of positive change. Offers hallmark coverage of Bloom\'s taxonomy, SQ3R integration, Information and Financial literacy. Major defining topics include first generation students, adult learners, making successful transitions, and planning for success in the second year and beyond. The ancillary materials are designed to assist instructors in delivering a top-level student success course.\n ', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (612, '0321826027', '9780321826022', 'Precalculus with Modeling & Visualization', 2014, 10, 5, 1, 2, '8-1/2\" x 10-7/8\"', '1,176', '2013-01-07 00:00:00', 'By connecting applications, modeling, and visualization, Gary Rockswold motivates students to learn mathematics in the context of their experiences. In order to both learn and retain the material, students must see a connection between the concepts and their real lives. In this new edition, connections are taken to a new level with “See the Concept” features, where students make important connections through detailed visualizations that deepen understanding.\n \nRockswold is also known for presenting the concept of a function as a unifying theme, with an emphasis on the rule of four (verbal, graphical, numerical, and symbolic representations). A flexible approach allows instructors to strike their own balance of skills, rule of four, applications, modeling, and technology.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (613, '0133011208', '9780133011203', 'Business Math', 2014, 21, 5, 1, 3, '9\" x 11-7/8\"', '880', '2013-01-08 00:00:00', 'For courses in business mathematics, personal finance, or small business management.\n \nBusiness Math, Tenth Edition unlocks the world of math by showing how it is used in the business world. Written in a conversational style, the book covers essential topics such as banking, interest, insurance, taxes, depreciation, inventory, and financial statements. It carefully explains common business practices such as markup, markdown, and cash discounts—showing students how these tools work in small business or personal finance. Authors encourage self-starters from the beginning, with the review of basic math, annotated examples, stop and check exercises, skill builders and application exercises. This edition includes updated problem sets, new trends and laws, a revised financial statements chapter and the one-of-a-kind MyMathLab website.', 0);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (614, '020588539X', '9780205885398', 'Writing for Life: Sentences and Paragraphs', 2014, 20, 5, 4, 3, '8-1/2\" x 11\"', '560', '2013-01-09 00:00:00', 'The revolutionary approach of D.J. Henry’s Writing for Life offers a visually rich, high-interest, and down-to-earth approach that reinforces the writing process while showing students how to take responsibility for their learning.\n \nWhile the areas-for-learning are often steadfast, today’s developing writers learn differently than learners from 10, 15, 20 years ago. The overwhelming majority of today’s learners—having been influenced by television, interacted with the Web, and watched video games—are products of an environment where information is presented and ideas are expressed principally through visuals. D.J. Henry recognized the differences between today’s learners and learners of yesteryear, and wrote Writing for Life from the ground up to address the thinking and learning processes occurring today.\n \nThe ground-breaking design of Writing for Life (developed in conjunction with Dorling Kindersley Publishers [DK]) makes writing, reading and thinking processes visible, and shows the processes rather than just telling students about them. Highly graphic layouts and unique visual pedagogy empower students to transfer the learning strategies they already use in interpreting the visual world to the task of writing. This visual approach—created specifically for today’s visually-oriented learners-is complemented by the student-centered learning strategy called “What’s the Point?” Not only does \"What\'s the Point?\" demonstrate real-world scenarios or applications of writing in context, but this directed thinking activity also prompts students to set a learning goal, call on prior knowledge, predict information, focus on structure, and generate details for each writing lesson. Thus, the visual approach and the “What\'s the Point?” theme of Writing for Life inspire student-centered learning and motivation by illustrating the power of writing in life.\n \nThis edition of Writing for Life: Sentences and Paragraphs is supported by an enhanced MyWritingLab course, which offers text-specific exercises within the Learning Path, all of which feed into the MyWritingLab Gradebook.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (615, '0321826124', '9780321826121', 'Algebra and Trigonometry with Modeling & Visualization', 2014, 10, 5, 1, 2, '8-1/2\" x 10-7/8\"', '1,176', '2013-01-09 00:00:00', 'By connecting applications, modeling, and visualization, Gary Rockswold motivates students to learn mathematics in the context of their experiences. In order to both learn and retain the material, students must see a connection between the concepts and their real lives. In this new edition, connections are taken to a new level with “See the Concept” features, where students make important connections through detailed visualizations that deepen understanding.\n \nRockswold is also known for presenting the concept of a function as a unifying theme, with an emphasis on the rule of four (verbal, graphical, numerical, and symbolic representations). A flexible approach allows instructors to strike their own balance of skills, rule of four, applications, modeling, and technology.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (616, '0321865537', '9780321865533', 'Introductory and Intermediate Algebra 5e', 2014, 11, 5, 1, 2, '8-1/2\" x 10-7/8\"', '864', '2013-01-10 00:00:00', 'The Lial Series has helped thousands of students succeed in developmental mathematics by providing the best learning and teaching support to students and instructors. ', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (617, '0321854462', '9780321854469', 'Developmental Mathematics: Basic Mathematics and Algebra, 3/E', 2014, 11, 5, 1, 3, '8-1/2\" x 11\"', '1,400', '2013-01-10 00:00:00', 'The Support You Need to Succeed…Even On the Go!\n \nThe Lial Series has helped thousands of students succeed in developmental mathematics by providing the best learning and teaching support to students and instructors. With the new editions, the approachable writing and pedagogy, varied exercise sets, and robust ancillary resources have been updated. A tightly integrated MyMathLab course, new Lial Video Library, and fresh, interactive PowerPoint slides meet the changing needs of today’s students and instructors…even on the go!', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (618, '0205852068', '9780205852062', 'Bridging the Gap', 2014, 19, 5, 1, 3, '8\" x 10\"', '624', '2013-01-10 00:00:00', 'Brenda Smith’s Bridging the Gap was the first college reading text to focus on reading for college, and through its eleven editions has been the most popular textbook choice of developmental reading educators.\nOriginally written to help college readers develop into independent learners, Bridging the Gap has kept up with the demands of contemporary college reading courses by evolving the “bridge” theme. Brenda expanded on this concept by creating schema for content courses with academic readings, and ultimately linking textbook readings to recent news in the popular press and representing new “bridges” of text-to-text, text-to-world, and text-to-self. All the while, Brenda never lost sight of what is important to both college reading instructors and students: comprehensive skill instruction, dependable exercises and examples, vocabulary development, and wealth of high-interest readings (pulled from a variety of academic disciplines) that provide meaningful practice.\n \nThis edition of Bridging the Gap is supported by an enhanced MyReadingLab course, which offers text-specific exercises within the Learning Path, all of which feed into the MyReadingLab Gradebook.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (621, '0321826043', '9780321826046', 'Developmental Mathematics through Applications: Basic College Mathematics and Algebra', 2014, 11, 5, 1, 3, '9\" x 10-7/8\"', '1,000', '2013-01-13 00:00:00', 'The Akst/Bragg series’ success is built around clear and concise writing, a side-by-side “teach by example” approach, and integrated applications throughout that help students achieve conceptual understanding. The user-friendly design offers a distinctive side-by-side format that pairs examples and their solutions with corresponding practice exercises. Students understand from the very beginning that doing math is an essential part of learning it. Motivational, real-world applications demonstrate how integral mathematical understanding is to a variety of disciplines, careers, and everyday situations.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (622, '0321859227', '9780321859228', 'Prealgebra and Introductory Algebra, 4e', 2014, 11, 5, 1, 2, '8-1/2\" x 10-7/8\"', '1,320', '2013-01-14 00:00:00', 'The Lial Series has helped thousands of students succeed in developmental mathematics by providing the best learning and teaching support to students and instructors.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (623, '0321729560', '9780321729569', 'Precalculus Essentials', 2014, 10, 5, 1, 2, '8-1/2\" x 11\"', '720', '2013-01-17 00:00:00', 'Bob Blitzer has inspired thousands of students with his engaging approach to mathematics, making this beloved series the #1 in the market. Blitzer draws on his unique background in mathematics and behavioral science to present the full scope of mathematics with vivid applications in real-life situations. Students stay engaged because Blitzer often uses pop-culture and up-to-date references to connect math to students’ lives, showing that their world is profoundly mathematical.\n \nWith the Fourth Edition, Blitzer takes student engagement to a whole new level. In addition to the multitude of exciting updates to the text and MyMathLab® course, new application-based MathTalk videos allow students to think about and understand the mathematical world in a fun, yet practical way. Assessment exercises allow instructors to assign the videos and check for understanding of the mathematical concepts presented.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (624, '0321837347', '9780321837349', 'Precalculus', 2014, 10, 5, 1, 2, '8-1/2\" x 11\"', '1,200', '2013-01-17 00:00:00', 'Bob Blitzer has inspired thousands of students with his engaging approach to mathematics, making this beloved series the #1 in the market. Blitzer draws on his unique background in mathematics and behavioral science to present the full scope of mathematics with vivid applications in real-life situations. Students stay engaged because Blitzer often uses pop-culture and up-to-date references to connect math to students’ lives, showing that their world is profoundly mathematical.\n \nWith the Fifth Edition, Blitzer takes student engagement to a whole new level. In addition to the multitude of exciting updates to the text and MyMathLab® course, new application-based MathTalk videos allow students to think about and understand the mathematical world in a fun, yet practical way. Assessment exercises allow instructors to assign the videos and check for understanding of the mathematical concepts presented.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (625, '0132180537', '9780132180535', 'Career Tool Kit, The: Skills for Success', 2014, 32, 5, 1, 3, '8-1/2\" x 10-7/8\"', '368', '2013-01-22 00:00:00', 'For courses in Career Development and Career Success.\n \nThe Career Tool Kit is designed to especially help community college and vocational school students of all ages develop the skills and attitudes needed to successfully complete their educational program: search for, find, and win the job they want; transition smoothly from school to work or successfully re-enter the workforce; and build a long, happy, and successful working life, all in a user-friendly and visually appealing design. Coverage of important topics includes developing and maintaining a positive self image, managing time, budgeting and organizing finances, avoiding or reducing credit debt, and tracking down the resources available at school, in the community, and online. A focus on self-awareness teaches readers how to get to know themselves better so that they understand what kinds of jobs might best suit their unique talents and qualities, how to network and locate job opportunities, and how to present themselves in the best possible light on a resume as well as in an interview, and how to handle both failure and success. Additional topics discuss workplace communication with managers, co-workers, clients, and customers; qualities and skills that employers look for in their employees; rights on the job; critical thinking at work; improving and maintaining mental health and social intelligence; motivation, and more.\n \nStudents and Faculty are encouraged to visit the website for all Keys franchise materials, www.carterkeys.com, to correspond with the author team, view their speaking calendar, benefit from current articles, and more! \n \nTECHNOLOGY OFFERING: MyStudentSuccessLab is available with this book upon request. It is an online solution designed to help students ‘Start strong, Finish stronger’ by building skills for ongoing personal and professional development. Go to http://mystudentsuccesslab.com/mssl3 for a Point and Click DEMO of the Time Management module. \n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (626, '0321880110', '9780321880116', 'Elementary & Intermediate Algebra', 2014, 11, 5, 1, 2, '8-1/2\" x 11\"', '928', '2013-01-22 00:00:00', 'The Sullivan/Struve/Mazzarella Algebra program is designed to motivate students to “do the math”— at home or in the lab—through a full suite of resources that support a variety of learning environments. Instructors can choose the ideal combination of resources for their students:\nThe text is known for its two-column example format that provides annotations to the left of the algebra. These annotations explain what the authors are about to do in each step (instead of what was just done), just as an instructor would do.\nTwo MyMathLab® course options are now available: a standard course and a Ready to Go course. The Ready to Go option provides premade assignments for every section of the text.\nNEW! The Video Notebook is an unbound, three-hole punched workbook/note-taking guide that asks students to write down important definitions and procedures and work through key examples as they watch the “Author in Action” videos.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (627, '0321872185', '9780321872180', 'Intermediate Algebra 10', 2014, 11, 5, 1, 3, '8-1/2\" x 10-7/8\"', '912', '2013-01-22 00:00:00', 'The Lial Series has helped thousands of students succeed in developmental mathematics by providing the best learning and teaching support to students and instructors.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (628, '0133140423', '9780133140422', 'Business Math Brief', 2014, 21, 5, 1, 3, '', '704', '2013-01-22 00:00:00', 'For courses in business mathematics, personal finance, or small business management.\n \nBusiness Math Brief, Tenth Edition unlocks the world of math by showing how it is used in the business world. Written in a conversational style, the book covers essential topics such as banking, interest, insurance, taxes, depreciation, and inventory. It carefully explains common business practices such as markup, markdown, and cash discounts–showing students how these tools work in small business or personal finance. Authors encourage self-starters from the beginning, with the review of basic math, annotated examples, stop and check exercises, skill builders and application exercises. This edition includes updated problem sets, new trends and laws, and the one-of-a-kind MyMathLab website.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (629, '032181696X', '9780321816962', 'Precalculus: Essentials', 2014, 10, 5, 1, 2, '8-1/2\" x 10-7/8\"', '992', '2013-01-22 00:00:00', 'Ratti and McWaters wrote this series with the primary goal of preparing students to be successful in calculus. Having taught both calculus and precalculus, the authors saw firsthand where students would struggle, where they needed help making connections, and what material they needed in order to succeed in calculus. Their experience in the classroom shows in each chapter, where they emphasize conceptual development, real-life applications, and extensive exercises to encourage a deeper understanding.\n \nWith a new addition to the series, Precalculus Essentials, this text offers the best of both worlds: fast-paced, rigorous topics and a friendly, “teacherly” tone. This text is developed with a focus on key topics for calculus preparation.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (630, '0205730523', '9780205730520', 'World Myth', 2014, 13, 5, 1, 3, '6\" x 9\"', '496', '2013-01-23 00:00:00', 'Deviating from the typical thematically organized mythology anthology, Barry Powell organizes this text first by geography and then by chronology. By doing this the text becomes a ‘history of the world,’ showing us how different peoples understood their environment and its challenges through myth.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (631, '0205902308', '9780205902309', 'World of Short Stories: 20 Short Stories from Around the World', 2014, 19, 5, 1, 3, '6\" x 9\"', '480', '2013-01-23 00:00:00', 'A World of Short Stories introduces a selection of short stories from around the globe into the college reading course.\nWith an outstanding selection of authors and carefully designed apparatus, the book is the ideal vehicle for introducing world literature to developing readers. A World of Short Stories is organized around different literary elements, such as characters, setting, plot, and irony, the selections in the text are surrounded by pedagogy including vocabulary exercises, pre-reading questions, extensive journal assignments, comprehension quizzes, and writing prompts.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (632, '0321848748', '9780321848741', 'Elementary and Intermediate Algebra: Concepts & Applications', 2014, 11, 5, 1, 2, '8-1/2\" x 10-7/8\"', '1,058', '2013-01-28 00:00:00', 'Objective: Skills to Concepts\n \nThe Bittinger Concepts and Applications Program delivers proven pedagogy, guiding students from skills-based math to the concepts-oriented math required for college courses. The new editions support students with a tightly integrated MyMathLab course (access kit available separately), quality applications and exercises, and a new MyMathGuide workbook and video program (available separately).', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (633, '0321848837', '9780321848833', 'Brief Calculus & Its Applications', 2014, 9, 5, 1, 2, '8-1/2\" x 10-7/8\"', '600', '2013-01-30 00:00:00', 'This is the brief version of Calculus and Its Applications, Thirteenth Edition, containing chapters 1–9. For the main text, please see ISBN 978-0-321-84890-1.\n \nCalculus and Its Applications, Thirteenth Edition is a comprehensive, yet flexible, text for students majoring in business, economics, life science, or social sciences. The authors delve into greater mathematical depth than other texts while motivating students through relevant, up-to-date, applications drawn from students’ major fields of study. The authors motivate key ideas geometrically and intuitively, providing a solid foundation for the more abstract treatments that follow. Every chapter includes a large quantity of exceptional exercises—a hallmark of this text--that address skills, applications, concepts, and technology. The MyMathLab® course for the text features thousands of assignable exercises, built-in support for gaps in basic skills, and an array of interactive figures designed to help students visualize key concepts.\n \nThe Thirteenth Edition includes updated applications, exercises, and technology coverage. The authors have also added more study tools, including a prerequisite skills diagnostic test and a greatly improved end-of-chapter summary, and made content improvements based on user reviews.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (636, '0321795911', '9780321795915', 'Trigonometry', 2014, 10, 5, 1, 2, '8-1/2\" x 11\"', '770', '2013-02-06 00:00:00', 'Bob Blitzer has inspired thousands of students with his engaging approach to mathematics, making this beloved series the #1 in the market. Blitzer draws on his unique background in mathematics and behavioral science to present the full scope of mathematics with vivid applications in real-life situations. Students stay engaged because Blitzer often uses pop-culture and up-to-date references to connect math to students’ lives, showing that their world is profoundly mathematical.\n \nWith the First Edition, Blitzer takes student engagement to a whole new level. In addition to the multitude of exciting updates to the text and MyMathLab® course, new application-based MathTalk videos allow students to think about and understand the mathematical world in a fun, yet practical way. Assessment exercises allow instructors to assign the videos and check for understanding of the mathematical concepts presented.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (637, '0321851668', '9780321851666', 'Elementary Statistics Using Excel', 2014, 3, 5, 1, 2, '8-1/2\" x 10-7/8\"', '832', '2013-02-11 00:00:00', 'From SAT scores to job search methods, statistics influences and shapes the world around us. Marty Triola’s text continues to be the bestseller because it helps students understand the relationship between statistics and the world, bringing life to the theory and methods.\n \nElementary Statistics raises the bar with every edition by incorporating an unprecedented amount of real and interesting data that will help instructors connect with students today, and help them connect statistics to their daily lives. The Twelfth Edition contains more than 1,800 exercises, 89% of which use real data and 85% of which are new. Hundreds of examples are included, 91% of which use real data and 84% of which are new. New coverage of Ethics in Statistics highlights new guidelines that have been established in industry.\n \nThe accompanying MyStatLab™ online course provides users with countless opportunities to practice, plus learning tools that enhance their experience and comprehension. Instructions and displays for StatCrunch®, Pearson’s powerful online statistical software, are now integrated into the text as well as the MyStatLab course.\n \nElementary Statistics is part of a series that also includes an Essentials version as well as technology-specific texts, Elementary Statistics Using the TI 83/84 Calculator and Elementary Statistics Using Excel. Data sets and other resources for this series are available at our website.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (638, '0133378713', '9780133378719', 'C++ How to Program (Early Objects Version)', 2014, 23, 5, 1, 3, '7\" x 9-1/8\"', '1,104', '2013-02-12 00:00:00', 'For Introduction to Programming (CS1) and other more intermediate courses covering programming in C++. Also appropriate as a supplement for upper-level courses where the instructor uses a book as a reference for the C++ language.\n\nThis best-selling comprehensive text is aimed at readers with little or no programming experience. It teaches programming by presenting the concepts in the context of full working programs and takes an early-objects approach. The authors emphasize achieving program clarity through structured and object-oriented programming, software reuse and component-oriented software construction. The Ninth Edition encourages students to connect computers to the community, using the Internet to solve problems and make a difference in our world. All content has been carefully fine-tuned in response to a team of distinguished academic and industry reviewers. \n\nView the Deitel Buzz online to learn more about the newest publications from the Deitels.\n\nNEW! This edition is available with MyProgrammingLab, an innovative online homework and assessment tool. Through the power of practice and immediate personalized feedback, MyProgrammingLab helps students fully grasp the logic, semantics, and syntax of programming.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (639, '0133378500', '9780133378504', 'An Introduction to Programming Using Visual Basic 2012(w/Visual Studio 2012 Express Edition DVD)', 2014, 26, 5, 1, 3, '8-1/2\" x 10-7/8\"', '768', '2013-02-22 00:00:00', 'Schneider’s “tried and true” text — consistently praised by both students and instructors — is designed for students with no prior computer programming experience. Now updated for Visual Basic 2012, Schneider focuses on teaching problem-solving skills and sustainable programming skills. A broad range of real-world examples, section-ending exercises, case studies, and programming projects gives students more hands-on experience than any other Visual Basic book on the market.\n\nNEW! This edition is available with MyProgrammingLab, an innovative online homework and assessment tool. Through the power of practice and immediate personalized feedback, MyProgrammingLab helps students fully grasp the logic, semantics, and syntax of programming.\n\nNote: If you are purchasing the standalone text or electronic version, MyProgrammingLab does not come automatically packaged with the text. To purchase MyProgrammingLab, please visit: myprogramminglab.com or you can purchase a package of the physical text + MyProgrammingLab by searching the Pearson Higher Education web site. MyProgrammingLab is not a self-paced technology and should only be purchased when required by an instructor.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (642, '0321845862', '9780321845863', 'Developmental Mathematics', 2014, 11, 5, 4, 2, '8-1/2\" x 11\"', '', '2013-02-28 00:00:00', 'The Sullivan/Struve/Mazzarella Algebra program is designed to motivate students to “do the math”— at home or in the lab—through a full suite of resources that support a variety of learning environments. Instructors can choose the ideal combination of resources for their students:\nThe text is known for its two-column example format that provides annotations to the left of the algebra. These annotations explain what the authors are about to do in each step (instead of what was just done), just as an instructor would do.\nTwo MyMathLab® course options are now available: a standard course and a Ready to Go course. The Ready to Go option provides premade assignments for every section of the text.\nNEW! The Video Notebook is an unbound, three-hole punched workbook/note-taking guide that asks students to write down important definitions and procedures and work through key examples as they watch the “Author in Action” videos.\n', 0);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (643, '0132871696', '9780132871693', 'Engineering Vibration', 2014, 35, 5, 1, 2, '7\" x 9-1/8\"', '688', '2013-03-07 00:00:00', 'For one/two-semester introductory courses in vibration for undergraduates in Mechanical Engineering, Civil Engineering, Aerospace Engineering and Mechanics\n \nServing as both a text and reference manual, Engineering Vibration, 4e, connects traditional design-oriented topics, the introduction of modal analysis, and the use of MATLAB, Mathcad, or Mathematica. The author provides an unequaled combination of the study of conventional vibration with the use of vibration design, computation, analysis and testing in various engineering applications.\n ', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (644, '0321880854', '9780321880857', 'Developmental Mathematics: Prealgebra, Beginning, Intermediate Algebra', 2014, 11, 5, 2, NULL, '', '', '2013-03-19 00:00:00', 'With You Every Step of the Way\n \nThe new Tobey/Slater/Blair/Crawford Developmental Mathematics: Prealgebra, Beginning Algebra, and Intermediate Algebra offers everything needed to teach the full developmental math sequence in one flexible, modularized course solution, including new Use Math to Save Money Animations. The topic-based modules build essential skills one at a time by breaking the mathematics down into manageable pieces, and guide students every step of the way for all course environments, including hybrid, self-paced, and online.\n \nTeaching and Learning Experience\nTo provide a better teaching and learning experience for both instructors and students, this program will:\nImprove Results: MyMathLab delivers proven results in helping students succeed and provides engaging experiences that personalize learning.\nGuide Students: This new course includes all of MyMathLab’s robust student features, including an eText that guides students every step of the way.\nProvide an All-in-One Solution with Print Support: The course is a complete all-in-one MyMathLab solution with everything needed for Prealgebra, Beginning Algebra, and Intermediate Algebra. Additionally, Worksheets with the Math Coach are available for additional learning support and a printed version of the text can be ordered via Pearson Learning Solutions.', 0);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (646, '0133125904', '9780133125900', 'Power Electronics: Circuits,Devices & Applications', 2014, 38, 5, 4, 2, '7\" x 9-1/8\"', '912', '2013-05-15 00:00:00', 'For junior or senior undergraduate students in Electrical and Electronic Engineering.\nThis text covers the basics of emerging areas in power electronics and a broad range of topics such as power switching devices, conversion methods, analysis and techniques, and applications. Its unique approach covers the characteristics of semiconductor devices first, then discusses the applications of these devices for power conversions. Four main applications are included: flexible ac transmissions (FACTs), static switches, power supplies, dc drives, and ac drives.', 0);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (648, '0205778844', '9780205778843', 'The DK Guide to Literature', 2014, 13, 5, 2, 3, '8\" x 10\"', '1,728', '2013-07-01 00:00:00', 'The DK Guide to Literature is visual, comprehensive and flexible. It is organized by genre and employs DKs dynamic visual style to guide students through the literary elements and close readings of sample texts and the fundamentals of writing about literature.  It also uses examples from everyday life to engage students and activate their prior knowledge, then builds on that foundation to move students toward more attentive literary reading.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (649, '0321818458', '9780321818454', 'Math Lit', 2014, 11, 5, 4, 3, '8-1/2\" x 11\"', '850', '2013-07-08 00:00:00', 'Math Lit, by Kathleen Almy and Heather Foes, provides a one-semester alternative to the traditional two-semester developmental algebra sequence for non-STEM (Science, Technology, Engineering, and Math) students. This new approach offers an accelerated pathway to college readiness through developmental math, allowing non-STEM students to move directly into liberal arts math or introductory statistics, while also preparing STEM students for intermediate algebra. Through its emphasis on contextual problem-solving, the Almy/Foes worktext and its accompanying MyMathLab® course help students understand and practice the major themes of numeracy, proportional reasoning, algebraic reasoning, and functions.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (652, '0132481197', '9780132481199', 'Career Adventure: Your Guide to Personal Assessment, Career Exploration, and Decision Making', 2014, 32, 5, 2, 3, '8-1/4\" x 10-7/8\"', '256', '2013-08-15 00:00:00', 'For courses in Career Development and Career Planning.\n \nThe Career Adventure leverages the power of peer and mentor support guiding students through a flexible, yet comprehensive, approach to career planning in a world in which change continues to influence the career landscape.\n \nThis book is a full-range approach for adult students who are seeking engagement in a systematic process to career decision-making. Whether students are new to career planning and trying to determine how their experiences prepare them for future careers or seasoned pros who are moving on to a new career opportunity, a series of steps helps them build on the growth and learning that has informed their prior work lives. Students will use their experiences as part of a process that contextualizes skills, knowledge, and background to inform future success. Grounded in ‘doing’ rather than ‘explaining,’ students are encouraged to move aggressively through these steps for life-long career development. The revision focuses on setting and achieving career goals that offer long-term growth, and uses social networking media to create a vibrant exchange that supports mutual value and meaning. The opportunity to capitalize on the knowledge of fellow career seekers maximizes information sharing and reflection for better, more illuminated goal-setting and decision-making.\n \nTECHNOLOGY OFFERING: MyStudentSuccessLab is available upon request. It is an online solution designed to help students ‘Start strong, Finish stronger’ by building skills for ongoing personal and professional development. Go to http://mystudentsuccesslab.com/mssl3 for a Point and Click DEMO. \n \n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (676, '0132461862', '9780132461863', 'International Monetary & Financial  Economics', 2014, 16, 6, 1, 2, '8\" x 10\"', '608', '2012-12-21 00:00:00', 'One book with all of the content you need to teach the International Economics course\n \nInternational Monetary and Financial Economics is an accessible, motivating textbook that covers the full range of topics appropriate for a complete course in international money and finance.  With balanced coverage of both international finance and open-economy macroeconomics, instructors using this book will be prepared to cover all of the substantive issues in the field today. To motivate student learning, Management, Policy, and Online Notebook features provide more than 50 examples of international financial issues, recent policy issues, and the role of worldwide electronic commerce.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (677, '0132992795', '9780132992794', 'Macroeconomics, 2/e', 2014, 17, 6, 1, 2, '8\" x 10\"', '650', '2012-12-21 00:00:00', 'Make the link between theory and real-world easier for students with the most up-to-date Intermediate Macroeconomics text on the market today!\n \nHubbard, O\'Brien, and Rafferty realize that most students enrolled in today\'s intermediate macroeconomics courses are either undergraduate or masters students who are likely to become entrepreneurs, managers, bankers, stock brokers, accountants, lawyers, or government officials.  Very few students will pursue a Ph.D. in economics.  Given this student profile, Hubbard, O\'Brien, and Rafferty\'s text presents Intermediate Macroeconomics in the context of contemporary events, policy, and business with an integrated explanation of today\'s financial crisis.  Student and instructor feedback tells us that Hubbard, O\'Brien, and Rafferty helps make the link between theory and real-world easier for students!', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (678, '0133074676', '9780133074673', 'Marketing Research', 2014, 7, 6, 1, 2, '8\" x 10\"', '662', '2012-12-28 00:00:00', 'For undergraduate marketing research courses. \n\nThe “nuts and bolts” of marketing research.\n\nMarketing Research gives students a “nuts and bolts” understanding of marketing research and provides them with extensive information on how to use it. Written at a level first-time marketing research students can understand, this text provides the fundamentals of the statistical procedures used to analyze data without dwelling on the more complex and intricate concepts.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (680, '0133252817', '9780133252811', 'Introduction to Programming with C++', 2014, 26, 6, 1, 3, '8\" x 10\"', '672', '2013-01-04 00:00:00', 'For undergraduate students in Computer Science and Computer Programming courses\n \nA solid foundation in the basics of C++ programming will allow students to create efficient, elegant code ready for any production environment.\n \nLearning basic logic and fundamental programming techniques is essential for new programmers to succeed. A distinctive fundamentals-first approach and clear, concise writing style characterize Introduction to Programming with C++, 3/e. Basic programming concepts are introduced on control statements, loops, functions, and arrays before object-oriented programming is discussed. Abstract concepts are carefully and concretely explained using simple, short, and stimulating examples. Explanations are presented in brief segments, with many figures and tables.\n\nNEW! This edition is available with MyProgrammingLab, an innovative online homework and assessment tool. Through the power of practice and immediate personalized feedback, MyProgrammingLab helps students fully grasp the logic, semantics, and syntax of programming.\n \nNote: If you are purchasing the standalone text or electronic version, MyProgrammingLab does not come automatically packaged with the text. To purchase MyProgrammingLab, please visit: myprogramminglab.com or you can purchase a package of the physical text + MyProgrammingLab by searching the Pearson Higher Education web site.  MyProgrammingLab is not a self-paced technology and should only be purchased when required by an instructor.\n \nTeaching and Learning Experience\nTo provide a better teaching and learning experience, for both instructors and students, this program offers:\nFundamentals-First: Basic programming concepts are introduced on control statements, loops, functions, and arrays before object-oriented programming is discussed.\nProblem-Driven Motivation: The examples and exercises throughout the book emphasize problem solving and foster the concept of developing reusable components and using them to create practical projects.\nSupport for Instructors and Students: The author maintains a website at http://www.cs.armstrong.edu/liang/cpp3e that includes multiple interactive resources.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (681, '0133116646', '9780133116649', 'Electrical Engineering: Principles & Applications', 2014, 38, 6, 1, 2, '8\" x 10\"', '912', '2013-01-07 00:00:00', 'For undergraduate introductory or survey courses in electrical engineering\nA clear introduction to electrical engineering fundamentals\n \nElectrical Engineering: Principles and Applications, 6e helps students learn electrical-engineering fundamentals with minimal frustration. Its goals are to present basic concepts in a general setting, to show students how the principles of electrical engineering apply to specific problems in their own fields, and to enhance the overall learning process. Circuit analysis, digital systems, electronics, and electromechanics are covered. A wide variety of pedagogical features stimulate student interest and engender awareness of the material’s relevance to their chosen profession.\n \nNEW: This edition is now available with MasteringEngineering, an innovative online program created to emulate the instructor’s office–hour environment, guiding students through engineering concepts from Electrical Engineering with self-paced individualized coaching.\n \nNote: If you are purchasing the standalone text or electronic version, MasteringEngineering does not come automatically packaged with the text. To purchase MasteringEngineering, please visit: masteringengineering.com or you can purchase a package of the physical text + MasteringEngineering by searching the Pearson Higher Education website. Mastering is not a self-paced technology and should only be purchased when required by an instructor.\n ', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (682, '0132666790', '9780132666794', 'Essentials of Entrepreneurship and Small Business Management', 2014, 31, 6, 1, 3, '8-1/2\" x 10-7/8\"', '638', '2013-01-09 00:00:00', 'For courses in Small Business Management, Entrepreneurship, New Venture Creation, and New Venture Management.\n\nThe tools to launch a new venture and the knowledge for entrepreneurial success. \n\nWith a practical, “hands on” approach to entrepreneurship, this text aims to provide students with the knowledge and tools they need to launch a business so that it has the greatest chance for success.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (683, '0132869500', '9780132869508', 'Ownership Series: Ownership: Accountability', 2014, 33, 6, 1, NULL, '8-1/2\" x 10-7/8\"', '32', '2013-01-22 00:00:00', 'For Bootcamp/Orientation, Student Success, Learning Strategies/Study Skills, and ANY content area course to provide instructors with multimedia training and students to develop ownership around the featured topic (ie. - Ownership: Accountability).\n \nDo you remember how you learned to ride a bike? It probably went something like, \'put on the training wheels, learn to brake/steer; remove training wheels, try to ride with a strong hand on the back to keep you balanced, try on your own as you wobbled along; then fell a few times before you...rode away and never looked back\'.\n \nIf you teach students ownership of these concepts in class, they are more likely to take responsibility for their successes and failures and “own” their learning. Our instructional materials are different than anything else on the market both in format and content. First, we offer a multimedia professional development course on Ownership in an easy-to-use online format that walks through teaching methods and includes ready-to-use activities, coaching tips, assessments, animations, and video on a topic (ie. – Accountability). Second, we provide a short, affordable student print or digital booklet covering ownership essentials and the critical thinking topic that can be used independently or as part of your course.\n \nInstructors will learn how to use this groundbreaking four-step process to teach ownership to any student in any class.  This method moves them from dependent to independent learning, so students can apply the process to any course and the workplace.\n \nInfuse student success into any program with our “IDentity” Series booklets.  Written by national subject matter experts, the material contains strategies and activities for immediate application. If you like this IDentity Series: Ownership topic, you\'ll love the other choices.\n \nAVAILABILITY: It is available via our Pearson Custom Library program as a standalone product or as part of a custom text.  Go to http://www.pearsonlearningsolutions.com/custom-library/pearson-custom-student-success-and-career-development  to view the content and build your book! \n \nYou can view samples by flipping through this catalog http://www.pageturnpro.com/Pearson-Education/42339-Pearson-IDentity-Series/index.html#1\n ', 1);
