INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (687, '0132136422', '9780132136426', 'Introduction to Materials Science', 2014, 34, 6, 1, 3, '8\" x 10\"', '700', '2013-01-23 00:00:00', 'For the Introductory Materials Science course. \n \nThis unique textbook is designed to serve as an active learning tool that uses carefully selected information and guided inquiry questions. Guided inquiry helps students reach true understanding of concepts as they develop greater ownership over the material presented. First, background information or data is presented. Then, concept invention questions lead the students to construct their own understanding of the fundamental concepts represented. Finally, application questions provide the students with practice in solving problems using the concepts that they have derived from their own valid conclusions. ', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (688, '013340675X', '9780133406757', 'Essentials of Processes, Systems and Information: with SAP tutorials', 2014, 6, 6, 1, 3, '8-1/2\" x 10-7/8\"', '160', '2013-02-21 00:00:00', 'For introductory courses in Management Information Systems \n\nEssentials of Processes, Systems, and Information with SAP Tutorials provides a concise introduction to MIS with a hands-on approach to business processes. \n\nAuthored by Earl H. McKinney, Jr. and David M. Kroenke, the text shows students exactly how businesses use information systems and technology to accomplish their goals, objectives, and competitive strategy. Packed with examples of business situations, both real and fictitious, the book helps students understand what business systems actually are—and see why they are so important.\n\nThe text consists of the five SAP-focused chapters from McKinney and Kroenke’s Processes, Systems, and Information: An Introduction to MIS. A pair of appendices after chapters four and five contains SAP process exercises that enable students to get hands-on experience applying what they’re learning in the course. This clear emphasis on business processes, and SAP in particular, makes Essentials of Processes, Systems, and Information the ideal text for courses attended by students not majoring in MIS.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (689, '0133255433', '9780133255430', 'Horngren\'s Financial & Managerial Accounting, The Managerial Chapters', 2014, 30, 6, 1, 3, '8-1/2\" x 10-7/8\"', '740', '2013-02-22 00:00:00', 'For courses in Financial and Managerial Accounting\n\n\nRedefining tradition in the accounting course.\n\nThe fourth edition of Horngren’s Financial and Managerial Accounting presents the core content of the accounting course in a fresh format designed to help today’s learners succeed. \n\nBuilt upon the foundation of the Horngren franchise, this new edition was created by an all-new author team who sought to bridge the gap between textbook content and classroom instruction techniques. New pedagogical features such as Instructor Tips & Tricks and Common Questions, Answered walk students through the material as a great instructor would, fostering deeper understanding of accounting theory and practice. \n\nThe table of contents for the fourth edition has been significantly overhauled to match the way the contemporary course is often taught. Additionally, the whole text has been put through a rigorous accuracy check, so instructors can be confident that it is up-to-date and error-free. And thorough integration between the text and MyAccountingLab places practice opportunities just a few clicks away–and provides a truly interactive learning experience.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (690, '0133255573', '9780133255577', 'Horngren\'s Financial & Managerial Accounting. The Financial Chapters', 2014, 30, 6, 1, 3, '8-1/2\" x 10-7/8\"', '1,100', '2013-02-22 00:00:00', 'For courses in Financial and Managerial Accounting\n\n\nRedefining tradition in the accounting course.\n\nThe fourth edition of Horngren’s Financial and Managerial Accounting presents the core content of the accounting course in a fresh format designed to help today’s learners succeed. \n\nBuilt upon the foundation of the Horngren franchise, this new edition was created by an all-new author team who sought to bridge the gap between textbook content and classroom instruction techniques. New pedagogical features such as Instructor Tips & Tricks and Common Questions, Answered walk students through the material as a great instructor would, fostering deeper understanding of accounting theory and practice. \n\nThe table of contents for the fourth edition has been significantly overhauled to match the way the contemporary course is often taught. Additionally, the whole text has been put through a rigorous accuracy check, so instructors can be confident that it is up-to-date and error-free. And thorough integration between the text and MyAccountingLab places practice opportunities just a few clicks away–and provides a truly interactive learning experience.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (692, '0133354695', '9780133354690', 'Cryptography and Network Security: Principles and Practice', 2014, 25, 6, 1, 2, '7\" x 9-1/8\"', '744', '2013-03-06 00:00:00', 'For one-semester, undergraduate- or graduate-level courses in Cryptography, Computer Security, and Network Security\n \nA practical survey of cryptography and network security with unmatched support for instructors and students\n \nIn this age of universal electronic connectivity, viruses and hackers, electronic eavesdropping, and electronic fraud, security is paramount. This text provides a practical survey of both the principles and practice of cryptography and network security. First, the basic issues to be addressed by a network security capability are explored through a tutorial and survey of cryptography and network security technology. Then, the practice of network security is explored via practical applications that have been implemented and are in use today. An unparalleled support package for instructors and students ensures a successful teaching and learning experience. \n \nTeaching and Learning Experience\nTo provide a better teaching and learning experience, for both instructors and students, this program will:\nSupport Instructors and Students: An unparalleled support package for instructors and students ensures a successful teaching and learning experience. \nApply Theory and/or the Most Updated Research: A practical survey of both the principles and practice of cryptography and network security.\nEngage Students with Hands-on Projects: Relevant projects demonstrate the importance of the subject, offer a real-world perspective, and keep students interested.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (693, '0133370437', '9780133370430', 'Network Security Essentials: Applications and Standards, 5/e', 2014, 25, 6, 1, 3, '7\" x 9-1/8\"', '432', '2013-03-06 00:00:00', 'For computer science, computer engineering, and electrical engineering majors taking a one-semester undergraduate courses on network security.\n \nA practical survey of network security applications and standards, with unmatched support for instructors and students.\n \nIn this age of universal electronic connectivity, viruses and hackers, electronic eavesdropping, and electronic fraud, security is paramount. Network Security: Applications and Standards, Fifth Edition provides a practical survey of network security applications and standards, with an emphasis on applications that are widely used on the Internet and for corporate networks. An unparalleled support package for instructors and students ensures a successful teaching and learning experience. \n \nAdapted from Cryptography and Network Security, Sixth Edition, this text covers the same topics but with a much more concise treatment of cryptography. \n ', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (694, '0133379337', '9780133379334', 'Visual C# 2012 How to Program', 2014, 23, 6, 1, 3, '7\" x 9-1/8\"', '998', '2013-03-08 00:00:00', 'Appropriate for all basic-to-intermediate level courses in Visual C# 2012 programming.\n \nCreated by world-renowned programming instructors Paul and Harvey Deitel, Visual C# 2012 How to Program, Fifth Edition introduces all facets of the C# 2012 language hands-on, through hundreds of working programs. This book has been thoroughly updated to reflect the major innovations Microsoft has incorporated in Visual C# 2012; all discussions and sample code have been carefully audited against the newest Visual C# language specification.\n\nStudents begin by getting comfortable with the C# Express 2012 IDE and basic Visual C# syntax. Next, they build their skills one step at a time, mastering control structures, classes, objects, methods, variables, arrays, and the core techniques of object-oriented programming. With this strong foundation in place, the Deitels introduce more sophisticated techniques, including searching, sorting, data structures, generics, and collections. Throughout, the authors show students how to make the most of Microsoft’s Visual Studio tools. A series of appendices provide essential programming reference material. \n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (695, '0132832887', '9780132832885', 'Aerodynamics for Engineers', 2014, 35, 6, 1, 2, '7\" x 9-1/8\"', '752', '2013-03-25 00:00:00', 'For junior/senior and graduate-level courses in Aerodynamics, Mechanical Engineering, and Aerospace Engineering\n \nRevised to reflect the technological advances and modern application in Aerodynamics, the Sixth Edition of Aerodynamics for Engineers merges fundamental fluid mechanics, experimental techniques, and computational fluid dynamics techniques to build a solid foundation for students in aerodynamic applications from low-speed through hypersonic flight. It presents a background discussion of each topic followed by a presentation of the theory, and then derives fundamental equations, applies them to simple computational techniques, and compares them to experimental data.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (696, '0133140512', '9780133140514', 'Entrepreneurial Finance', 2014, 5, 6, 1, 3, '8\" x 10\"', '448', '2013-03-26 00:00:00', 'For courses in Entrepreneurial Finance, Entrepreneurship, Small Business Ownership.\n \nFor many, starting a business can be an overwhelming experience. Understanding the financial aspects of running a business can be even more daunting. Entrepreneurial Finance, Sixth Edition was written to help a broad range of U.S. business owners understand the financial aspects of entrepreneurship. Unlike traditional corporate finance books, this text explains the financial topics most important to running a profitable small business suchasinventory control, time value of money, working capital management, and forecasting. Updated to reflect recent economic trends, this edition also shows how  two popular business tools (excel and TI BA II Plus calculator) can assist business owners in problem-solving and decision-making.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (697, '013261930X', '9780132619301', 'English for Careers: Business, Professional, and Technical', 2014, 8, 6, 1, 3, '8-1/2\" x 10-7/8\"', '600', '2013-04-08 00:00:00', 'For courses in Business English, Business Communications, English Composition, Developmental Writing & English.\n \n English for Careers, 11e is designed to keep pace with changing student populations and current workplace trends. Appropriate for a wide audience, it helps students acquire fluency in Standard English and understand the basic principles of grammar, punctuation and writing. Offering a warm tone and accessible presentation, it focuses on the “real-world” English skills needed to get a good job, hold a job, and advance in a career. This edition offers a new and improved instructional design, career connection features, more real-world assignments and access to the innovative MyWritingLab website. \n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (698, '0136157394', '9780136157397', 'Global Marketing Management', 2014, 7, 6, 4, 2, '8\" x 10\"', '625', '2013-04-16 00:00:00', 'For courses in International Marketing and Global Marketing.\nThis is the leading MBA text in international marketing—with comprehensive cases.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (701, '013267145X', '9780132671453', 'Adaptive Filter Theory', 2014, 38, 6, 4, 2, '7\" x 9-1/8\"', '936', '2013-05-15 00:00:00', 'For courses in Adaptive Filters.\nHaykin examines both the mathematical theory behind various linear adaptive filters and the elements of supervised multilayer perceptrons. In its fifth edition, this highly successful book has been updated and refined to stay current with the field and develop concepts in as unified and accessible a manner as possible.', 0);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (703, '0133023672', '9780133023671', 'Principles of Macroeconomics', 2014, 17, 6, 4, 3, '8-1/2\" x 10-7/8\"', '471', '2013-06-14 00:00:00', '\n\nReviewers tell us that Case/Fair is one of the all-time bestselling POE texts because they trust it to be clear, thorough and complete. \n ', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (704, '0133354857', '9780133354850', 'Fundamentals of Communication Systems', 2014, 38, 6, 4, 2, '7\" x 9-1/8\"', '832', '2013-06-21 00:00:00', 'For one- or two-semester, senior-level undergraduate courses in Communication Systems for Electrical and Computer Engineering majors.\n\nThis text introduces the basic techniques used in modern communication systems and provides fundamental tools and methodologies used in the analysis and design of these systems. The authors emphasize digital communication systems, including new generations of wireless communication systems, satellite communications, and data transmission networks. A background in calculus, linear algebra, basic electronic circuits, linear system theory, and probability and random variables is assumed.\n\n', 0);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (705, '0133451607', '9780133451603', 'Statics and Mechanics of Materials', 2014, 36, 6, 4, 2, '8\" x 9-1/4\"', '896', '2013-07-19 00:00:00', 'For introductory combined Statics and Mechanics of Materials courses found in ME, CE, AE, and Engineering Mechanics departments.\n\nA comprehensive and well-illustrated introduction to the theory and application of statics and mechanics of materials. The text presents a commitment to the development of student problem-solving skills and features many pedagogical aids unique to Hibbeler texts.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (706, '013601772X', '9780136017721', 'Introduction to Engineering Analysis', 2009, 36, 6, 4, 3, '8\" x 10\"', '366', '2013-08-15 00:00:00', 'For first-year engineering courses\n\nThe goal of this text is to introduce a general problem-solving approach for the beginning engineering student.  Thus, Introduction to Engineering Analysis  focuses on how to solve (any) kind of engineering analytical problem in a logical and systematic way. The book helps to prepare the students for such analytically oriented courses as statics, strength of materials, electrical circuits, fluid mechanics, thermodynamics, etc. \n ', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (707, '0321566440', '9780321566447', 'Managerial Economics', 2014, 16, 6, 4, 2, '8\" x 10\"', '800', '2013-08-23 00:00:00', 'Economics is a powerful tool that can help managers to manage effectively. In Managerial Economics and Strategy Jeffrey Perloff and James Brander use real-world issues and examples from actual markets to show future managers how economic principles can be used in business decisions.\n \nIn text examples and boxed mini-cases use actual data to illustrate how to use basic models. For example, to illustrate rivalry in oligopolistic markets, the authors look at rivalry between United and American Airlines and between Coke and Pepsi. Mini-case examples include why American Apparel is vertically integrated and why upscale manufacturers limit the number of designer hand-bags a customer is allowed to buy.\n \nTo help future managers learn to solve new problems, Perloff and Brander repeatedly demonstrate problem-solving through in-text Q&As. Each Q&A poses an important managerial or economic issue and demonstrates how to solve it using a step-by-step approach.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (782, '0133127648', '9780133127645', 'Public Relations Practices', 2014, 7, 6, 1, 3, '7\" x 9-1/8\"', '368', '2012-12-29 00:00:00', 'For undergraduate and graduate courses in Public Relations.\n\nWritten by two of the most respected individuals in the field, Public Relations Practices presents timeless case studies to help future practitioners develop agility in the principles and applications of effective two-way communications likely to confront them and their employer.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (783, '0133075354', '9780133075359', 'Fundamentals of Investing', 2014, 5, 6, 1, 2, '8\" x 10\"', '672', '2012-12-31 00:00:00', 'The core concepts and tools students need to make informed investment decisions.\n\nFundamentals of Investing helps students make informed investment decisions in their personal and professional lives by providing a solid foundation of core concepts and tools. Smart/Gitman/Joehnk use practical, hands-on applications to introduce the topics and techniques used by both personal investors and money managers. The authors integrate a consistent framework based on learning goals to keep students focused on what is most important in each chapter. Students leave the course with the necessary information for developing, implementing, and monitoring a successful investment program.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (784, '0133254429', '9780133254426', 'Mechanics of Materials', 2014, 36, 6, 1, 2, '8\" x 9-1/4\"', '880', '2013-01-03 00:00:00', 'For undergraduate Mechanics of Materials courses in Mechanical, Civil, and Aerospace Engineering departments.\n  \nContaining Hibbeler’s hallmark student-oriented features, this text is in four-color with a photorealistic art program designed to help students visualize difficult concepts.  A clear, concise writing style and more examples than any other text further contribute to students’ ability to master the material.\n \nThis edition is available with MasteringEngineering, an innovative online program created to emulate the instructor’s office–hour environment, guiding students through engineering concepts from Mechanics of Materials with self-paced individualized coaching.\n \nNote: If you are purchasing the standalone text or electronic version, MasteringEngineering does not come automatically packaged with the text. To purchase MasteringEngineering, please visit: masteringengineering.com or you can purchase a package of the physical text + MasteringEngineering by searching the Pearson Higher Education website. Mastering is not a self-paced technology and should only be purchased when required by an instructor.\n ', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (785, '0132974401', '9780132974400', 'Human Relations for Career and Personal Success: Concepts, Applications, & Skills', 2014, 31, 6, 1, 3, '8-1/2\" x 10-7/8\"', '576', '2013-01-15 00:00:00', 'For courses in human relations.\n \nHuman Relations for Career and Personal Success: Concepts, Applications, and Skills, Tenth Edition, shows how you can become more effective in your work and personal life by developing your human relations skills. Offering more insight into human behavior, the text covers topics such as career advancement, developing good work habits, and managing stress and personal problems. With his proven approach, DuBrin delves into human relations by looking at basic concepts followed by a heavy component of skill development and self-assessment. This tenth edition features over 60 new cases, exercises, assignments and assessments and a new MyBizSkillsKit website.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (786, '0137024878', '9780137024872', 'Managerial Accounting: Decision Making and Motivating Performance', 2014, 30, 6, 1, 2, '8-1/2\" x 10-7/8\"', '550', '2013-01-16 00:00:00', 'For courses in managerial accounting.\n\nGo beyond managerial accounting theory to the techniques used in management today.\n\nManagerial Accounting: Making Decisions and Motivating Performance enables future managers and business owners to attain the core skills they need to become integral members of their company’s decision-making teams. \n\nThis new program from established authors Srikant M. Datar and Madhav Rajan emphasizes decision-making and the implications of decisions. While many texts teach the theories and frameworks of management education, Managerial Accounting goes further by covering the capabilities and techniques necessary for effective management practice, as well as fostering attitudes that typify integrity, honesty, and fairness.\n\nA high-level business case in each chapter illustrates key concepts and helps students place the material in the context of real-world practice. And deep integration with MyAccountingLab provides students numerous opportunities to review and hone their understanding throughout the learning experience.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (787, '0133406954', '9780133406955', 'Visual Basic 2012 How to Program', 2014, 23, 6, 4, 3, '7\" x 9-1/8\"', '672', '2013-03-29 00:00:00', 'ppropriate for all basic-to-intermediate level courses in Visual Basic 2012 programming.\n\nCreated by world-renowned programming instructors Paul and Harvey Deitel, Visual Basic 2012 How to Program, Sixth Edition introduces all facets of the Visual Basic 2012 language through a hands-on approach with hundreds of working programs. This book has been thoroughly updated to reflect the major innovations Microsoft has incorporated in Visual Basic 2012; all discussions and sample code have been carefully audited against the newest Visual Basic language specification. The Sixth Edition is updated to Visual Studio 2012 and includes new chapters on Windows 8 UI app development, Windows 8 graphics/multimedia, Windows Phone 8 app development and Windows Azure.\n\nStudents begin by getting comfortable with the free Visual Basic Express 2012 IDE and basic VB syntax. Next, they build their skills one step at a time, mastering control structures, classes, objects, methods, variables, arrays, and the core techniques of object-oriented programming. With this strong foundation in place, the Deitels introduce more sophisticated techniques, including inheritance, polymorphism, exception handling, strings, GUI\'s, data structures, generics, and collections. Throughout, the authors show developers how to make the most of Microsoft’s Visual Studio tools. A series of appendices provide essential programming reference material on various topics.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (788, '0133128741', '9780133128741', 'Manufacturing Engineering & Technology', 2014, 34, 6, 1, 2, '8\" x 10\"', '1,200', '2013-04-01 00:00:00', 'For courses in manufacturing processes at two- or four-year schools\nAn up-to-date text that provides a solid background in manufacturing processes\n \nManufacturing Engineering and Technology, 7e, presents a mostly qualitative description of the science, technology, and practice of manufacturing. This includes detailed descriptions of manufacturing processes and the manufacturing enterprise that will help introduce students to important concepts.\n \nWith a total of 120 examples and case studies, up-to-date and comprehensive coverage of all topics, and superior two-color graphics, this text provides a solid background for manufacturing students and serves as a valuable reference text for professionals.\n \nTeaching and Learning Experience\nTo provide a better teaching and learning experience, for both instructors and students, this program will:\nApply Theory and/or Research: An excellent overview of manufacturing conceptswith a balance of relevant fundamentals and real-world practices.\nEngage Students: Examples and industrially relevant case studies demonstrate the importance of the subject, offer a real-world perspective, and keep students interested.\nSupport Instructors and Students: A Companion Website includes step-by-step Video Solutions, the Pearson eText, and color versions of all figure and tables in the book.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (789, '013335671X', '9780133356717', 'Machine Design', 2014, 35, 6, 4, 2, '8\" x 10\"', '1,008', '2013-05-01 00:00:00', 'For courses in Machine Design\nAn integrated, case-based approach to Machine Design\n \nMachine Design, 5e presents the subject matter in an up-to-date and thorough manner with a strong design emphasis. This textbook emphasizes failure theory and analysis as well as the synthesis and design aspects of machine elements. The book points out the commonality of the analytical approaches needed to design a wide variety of elements and emphasizes the use of computer-aided engineering as an approach to the design and analysis of these classes of problems. ', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (790, '013284737X', '9780132847377', 'Data Structures and Algorithm Analysis in C++', 2014, 26, 6, 4, 2, '7-3/8\" x 9-1/8\"', '608', '2013-06-28 00:00:00', 'Data Structures and Algorithm Analysis in C++ is an advanced algorithms book that bridges the gap between traditional CS2 and Algorithms Analysis courses.\n\nAs the speed and power of computers increases, so does the need for effective programming and algorithm analysis. By approaching these skills in tandem, Mark Allen Weiss teaches readers to develop well-constructed, maximally efficient programs using the C++ programming language.\n\nThis book explains topics from binary heaps to sorting to NP-completeness, and dedicates a full chapter to amortized analysis and advanced data structures and their implementation. Figures and examples illustrating successive stages of algorithms contribute to Weiss’ careful, rigorous and in-depth analysis of each type of algorithm.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (791, '0133405680', '9780133405682', 'Essentials of Database Management', 2014, 24, 6, 4, 3, '8-1/2\" x 10-7/8\"', '524', '2013-06-28 00:00:00', 'For courses in Database Management \n\nProvide the latest information in database development.\n\nFocusing on the topics that leading database practitioners say are most important, Essentials of Database Management presents a concise overview designed to ensure practical success for database professionals. \n\nBuilt upon the strong foundation of Modern Database Management, currently in its eleventh edition, the new Essentials of Database Management is ideal for a less-detailed course. Like its comprehensive counterpart, it guides students into the future by presenting research that could reveal the “next big thing” in database management. And it features up-to-date coverage in the areas undergoing rapid change due to improved managerial practices, database design tools and methodologies, and database technology.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (792, '0133485102', '9780133485103', 'Managing Engineering and Technology', 2014, 34, 6, 4, 2, '7\" x 9-1/8\"', '500', '2013-08-01 00:00:00', 'For courses in Technology Management, Engineering Management, or Introduction to Engineering Technology.\n\nManaging Engineering and Technology is designed to teach engineers, scientists, and other technologists the basic management skills they will need to be effective throughout their careers.\n\nVisit Morse & Babcock\'s EM Blog: A Blog for Engineering Management Educators for helpful resources: http://morseandbabcock.wordpress.com/', 0);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (793, '0136015727', '9780136015727', 'Reliability Engineering', 2014, 35, 6, 2, 2, '7\" x 9-1/8\"', '650', '2013-09-02 00:00:00', 'Reliability Engineering is intended for use as an introduction to reliability engineering, including the aspects analysis, design, testing, production and quality control of engineering components and systems. The book can be used for senior or dual-level courses on reliability.\n \nNumerous analytical and numerical examples and problems are used to illustrate the principles and concepts. Expanded explanations of the fundamental concepts are given throughout the book, with emphasis on the physical significance of the ideas. The mathematical background necessary in the area of probability and statistics is covered briefly to make the presentation complete and self-contained. Solving probability and reliability problems using MATLAB and Excel is also presented.', 0);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (891, '0133078353', '9780133078350', 'Marketing Plan Handbook', 2014, 7, 1, 1, 3, '7-3/8\" x 9-1/8\"', '214', '2012-12-21 00:00:00', 'For marketing courses that focus on creating a marketing plan.\n\nA step-by-step guide to creating a customized marketing plan. \n\nThe Marketing Plan Handbook is the only planning handbook to guide readers, step-by-step, through the complete development of a realistic, customized marketing plan.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (892, '013295351X', '9780132953511', 'Opportunities and Challenges of Workplace Diversity', 2014, 31, 1, 1, 3, '7\" x 9-1/8\"', '278', '2012-12-22 00:00:00', 'For courses in Diversity, Organizational Behavior, and Human Resource Management. \n\nUncover and understand the complexities of managing workplace diversity. \n\nOpportunities and Challenges of Workplace Diversity teaches students to uncover and understand the complexities of managing diversity through a unique dialogue of opportunity. Through its three-tiered structure this text effectively explains the complexities of managerial and legal aspects in workplace diversity; presents examples of positive and negative management methods; encourages students to develop a set of skills they will need when managing diversity in their future careers.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (893, '0133043592', '9780133043594', 'Manager\'s Bookshelf', 2014, 31, 1, 1, 3, '7\" x 9-1/8\"', '368', '2012-12-22 00:00:00', 'For undergraduate/graduate-level courses in Introduction to Management or Organizational Behavior.\n\nSample the best of the best philosophies, views, and theories in management. \n\nThe Manager’s Bookshelf: A Mosaic of Contemporary Views is a collection of objective summaries from a broad sampling of bestselling business books. Presenting readers with a collage of information to improve their knowledge of management practices, this text introduces the philosophies, views, and experiences of several authors whose works have captivated the attention of today\'s management community.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (894, '0132948915', '9780132948913', 'International Economics', 2014, 16, 1, 1, 2, '7-3/8\" x 9-1/8\"', '504', '2012-12-28 00:00:00', 'For an introductory International Economics course.\n\nA principles-level introduction to international economics that is accessible to all majors. \n\nInternational Economics uses a rich array of case studies to illuminate economic institutions and policies as well as recent developments in the global economy—without students having to rely on a prerequisite knowledge of higher-level math. Further, the text’s flexible approach—with self-contained chapters and comprehensive coverage—allows instructors to adapt the text easily to a wide range of syllabi. \n \nThe sixth edition preserves the organization and coverage of the fifth edition and adds a number of updates and enhancements. All tables and graphs have been updated and every chapter begins with a list of student learning outcomes. Chapter 13, The United States in the World Economy, is heavily revised and refocused towards U.S. international economic relations, including NAFTA, but adds material on other trade agreements, including a new case study on preferential agreements such as the African Growth and Opportunity Act.\n \nAvailable with the award-winning MyEconLab!\nMyEconLab is a powerful assessment and tutorial system that works hand-in-hand with International Economics. MyEconLab includes comprehensive homework, quiz, test, and tutorial options, where instructors can manage all assessment needs in one program! \n \nNote: If you are purchasing the standalone text (ISBN: 0132948915) or electronic version, MyEconLab does not come automatically packaged with the text. To purchase MyEconLab, please visit: www.myeconlab.com or you can purchase a package of the physical text + MyEconLab by searching the Pearson Higher Education web site. MyEconLab is not a self-paced technology and should only be purchased when required by an instructor.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (895, '0132971275', '9780132971270', 'Intercultural Business Communication', 2014, 8, 1, 1, 3, '7\" x 9-1/8\"', '312', '2012-12-29 00:00:00', 'For courses in Intercultural Business Communication.\n \nPrepare future managers to face the differences in business communication across cultures. \n\nWith the globalization of the world economy, it is imperative for current and future managers to be sensitive to the differences they will encounter in intercultural communication. To help make students aware of these differences, Intercultural Business Communication contains practical guidelines and information on how to conduct negotiations across countries, write business letters in different societies, and includes the general “dos” and “don’ts” in international business.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (896, '0132994895', '9780132994897', 'Psychology of Investing', 2014, 5, 1, 1, 3, '7-3/8\" x 9-1/8\"', '144', '2012-12-29 00:00:00', 'A supplement for undergraduate and graduate Investments courses.\n\nSee the decision-making process behind investments.\n\nThe Psychology of Investing is the first text of its kind to delve into the fascinating subject of how psychology affects investing. Its unique coverage describes how investors actually behave, the reasons and causes of that behavior, why the behavior hurts their wealth, and what they can do about it.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (897, '0133058786', '9780133058789', 'Introduction to Management Accounting', 2014, 30, 1, 1, 2, '8-1/2\" x 10-7/8\"', '900', '2012-12-31 00:00:00', 'For MBA-level managerial accounting courses.\n\nAn essential tool for understanding how to make effective economic decisions.\n\nIn today’s troubled economy, it’s important to show students how managerial decisions can affect business costs. Introduction to Management Accounting helps to enhance students’ ability to make effective economic decisions by encouraging them to understand the inner-workings of the concepts, rather than solely focusing on technique memorization. Overall, this text describes both theory and common practices in a way that will help students produce information that’s useful in day-to-day decision-making.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (898, '0133059049', '9780133059045', 'Better Business', 2014, 31, 1, 1, 3, '8-1/2\" x 10-7/8\"', '640', '2012-12-31 00:00:00', 'For Introduction to Business courses.\n \nBetter Business—a better experience for students and instructors!\n \nBetter Business offers the business content students need, but in a better way. By presenting the material in a stimulating Q&A format, Better Business encourages students to come to class prepared to have better conversations and a truly engaging classroom experience.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (899, '0132994348', '9780132994347', 'Personal Finance', 2014, 5, 1, 1, 3, '8-1/2\" x 10-7/8\"', '720', '2012-12-31 00:00:00', 'For students taking an introductory personal finance course.\n\nThe main feature of Personal Finance is its hands-on approach keyed to the concepts students need to build their own financial plans. The text’s seven parts are all pieces of a financial plan; Chapter 21 is the capstone.  A running example throughout the book and a variety of end-of-chapter cases reinforce the practical aspects of planning.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (904, '0133063003', '9780133063004', 'International Business', 2014, 31, 1, 1, 3, '8-1/2\" x 10-7/8\"', '480', '2013-01-02 00:00:00', 'For introductory International Business courses with the need for a brief, accessible text.\n\nA readable, concise, and innovative tour through the discipline, International Business: The Challenges of Globalization presents the subject matter in a comprehensive – yet succinct – framework. Real-world examples and engaging features bring concepts to life and make international business accessible to all students.\n\nThe Seventh Edition better explains the influence of the global credit crisis and recent recession on international business, and even more fully embraces the crucial role of emerging markets in today’s global economy.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (905, '0133117413', '9780133117417', 'Horngren\'s Accounting', 2014, 30, 1, 1, 2, '9\" x 10-7/8\"', '1,600', '2013-01-02 00:00:00', 'For courses in Principles of Accounting\n\nRedefining tradition in the accounting course.\n\nThe tenth edition of Horngren’s Accounting presents the core content of the accounting course in a fresh format designed to help today’s learners succeed. \n\nBuilt upon the foundation of the Horngren franchise, this new edition was created by an all-new author team who sought to bridge the gap between textbook content and classroom instruction techniques. New pedagogical features such as Instructor Tips & Tricks and Common Questions, Answered walk students through the material as a great instructor would, fostering deeper understanding of accounting theory and practice. \n\nThe table of contents for the tenth edition has been significantly overhauled to match the way the contemporary course is often taught. Additionally, the whole text has been put through a rigorous accuracy check, so instructors can be confident that it is up-to-date and error-free. And thorough integration between the text and MyAccountingLab places practice opportunities just a few clicks away–and provides a truly interactive learning experience.\n\nSee Lead author Tracie Nobles share the newly revised and revamped edition of Horngren’s Accounting: http://bit.ly/14Gn3Be \n \nTake a tour of Horngren\'s Accounting: http://bit.ly/horngrensaccounting', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (906, '0132575671', '9780132575676', 'Database Systems', 2014, 24, 1, 1, 3, '8-1/2\" x 10-7/8\"', '650', '2013-01-03 00:00:00', 'An introductory, yet comprehensive, database textbook intended for use in undergraduate and graduate information systems database courses.\n \nDatabase Systems: Introduction to Databases and Data Warehouses covers both analytical and operations database as knowledge of both is integral to being successful in today’s business environment. It also provides a solid theoretical foundation and hands-on practice using an integrated web-based data-modeling suite.\n \nTeaching and Learning Experience\nTo provide a better teaching and learning experience, for both instructors and students, this program will:\nPrepare Students for the Job Market with Operational AND Analytical Database Coverage: Students will learn to understand both operational and analytical databases to prepare them for today’s job market.\nEngage Students with Valuable Hands-On Practice: An integrated web-based data-modeling suite engages students as they create their own models.\nSupport Instructors: Author-written web supplements help bring the course to life.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (909, '0133077543', '9780133077544', 'Management: A Focus on Leaders', 2014, 31, 1, 1, 3, '8-1/2\" x 10-7/8\"', '720', '2013-01-03 00:00:00', 'For Principles of Management courses. \n\nWe need leadership now. \n\nFinancial crises, catastrophic disasters, and business scandals are constantly making today’s headlines. Annie McKee, author of the textbook Management: A Focus on Leaders, believes that amidst these issues we are experiencing a unique opportunity to add new fervor to the way we prepare students for the future. Directly addressing the challenges and opportunities in our changing world, Management: A Focus on Leaders shows future managers how to lead in a complex, yet exciting, global environment.\n\nVisit WeNeedLeadershipNow.com to find out more about Management: A Focus on Leaders.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (910, '0133020266', '9780133020267', 'Managerial Economics', 2014, 16, 1, 1, 2, '8\" x 10\"', '592', '2013-01-03 00:00:00', 'For upper-level undergraduate and first-year MBA courses in managerial and applied economics.\n\nThis text will excite readers by providing a more linear progression, while proving the consistency and relevance of microeconomic theory.\nThe Seventh Edition welcomes a new co-author, Stephen Erfle of Dickinson College, who has contributed many revisions and improvements to the quantitative sections of the text, as well as provided a major addition: the use of Excel in the presentation of many of the numerical and graphical illustrations presented throughout the text.   \n \nTo strengthen students’ ability to use Excel—a critical skill in today’s job market—new Excel Applications (Excel Apps) allow readers to turn the static figures and tables in the text into dynamic illustrations. ', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (911, '0132994844', '9780132994842', 'Economics', 2014, 16, 1, 1, 2, '8-1/2\" x 10-7/8\"', '864', '2013-01-04 00:00:00', '&>Get students to think like an Economist using the latest policy and data while incorporating global issues\nThoroughly updated, stripped of technical detail where possible, extensively illustrated with well-chosen photographs, enlivened with new applications features that focus on issues at play in today’s world, responsive to the suggestions of reviewers and users, and seamlessly integrated with MyEconLab: These are the hallmarks of this eleventh edition of Economics.\n \nParkin brings critical issues to the forefront. Each chapter begins with one of today’s key issues, and additional issues appear throughout the chapter to show the real-world applications of the theory being discussed. When the chapter concludes, students “read between the lines” to think critically about a news article relating to the issue, demonstrating how thinking like an economist can bring a clearer perspective to and deeper understanding of today’s events. Students will begin to think about issues the way real economists do and learn how to explore difficult policy problems and make more informed decisions in their own economic lives.\n \nParkin is so committed to currency that he uploads news articles almost daily to MyEconLab®, the online assessment and tutorial system that accompanies the text. Assessment questions based on the Economics in the News articles are uploaded periodically so that instructors can assign recent articles within MyEconLab.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (912, '0132994909', '9780132994903', 'Fundamentals of Human Resource Management', 2014, 31, 1, 1, 3, '8-1/2\" x 10-7/8\"', '486', '2013-01-04 00:00:00', 'For introductory courses in Human Resource Management.\n \nA brief format, ideal for instructors who want flexibility while maintaining the integrity of the material.\n \nFundamentals of Human Resource Management covers a wide range of HR topics and shows students the importance of human resource management within the restraints of a compact semester. Offering a wealth of functional examples and applications, this text emphasizes the notion that all managers need basic human resource management skills.\n \nThis edition is the first text on the market to build its core around the talent management process—which the author defines as the goal-oriented and integrated process of planning, recruiting, developing, managing, and compensating employees.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (913, '0132949334', '9780132949330', 'Economics', 2014, 16, 1, 1, 2, '8-1/2\" x 10-7/8\"', '792', '2013-01-04 00:00:00', 'For Principles of Economics courses. \n\nQuestions that drive interest, applications that illustrate concepts, and the tools to test and solidify comprehension. \n\nStudents come into their first Economics course thinking they will gain a better understanding of the economy around them. Unfortunately, they often leave with many unanswered questions. To ensure students actively internalize economics, O\'Sullivan/Sheffrin/Perez use chapter-opening questions to spark interest on important economic concepts, applications that vividly illustrate those concepts, and chapter-ending tools that test and solidify understanding.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (914, '0133029670', '9780133029673', 'Using MIS', 2014, 6, 1, 1, 3, '8-1/2\" x 10-7/8\"', '518', '2013-01-04 00:00:00', 'For undergraduate Introductory Management Information Systems courses.\n \nAn engaging introduction to how people use IS to solve business problems.\n \nUsing MIS explains why MIS is the most important course in the business school by showing students how businesses use information systems and technology to accomplish their goals, objectives, and competitive strategy.\n \nWith a new edition now publishing each year, Using MIS, 4e, contains fresh, new, and current material to help keep your students up to date.\n ', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (915, '0132967480', '9780132967488', 'Experiencing MIS', 2014, 6, 1, 1, 3, '8-1/2\" x 10-7/8\"', '662', '2013-01-04 00:00:00', 'For undergraduate Introduction to Management Information Systems courses.\n\nFlexible modules for instructors, real-world lessons for students.\n\nHelp your students see why MIS is the most important course in the business school with Experiencing MIS. This modular text shows students how businesses use–and need–information systems to accomplish their goals, objectives, and competitive strategy.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (916, '0133050696', '9780133050691', 'Management Information Systems', 2014, 6, 1, 1, 2, '8-1/2\" x 10-7/8\"', '630', '2013-01-04 00:00:00', 'For undergraduate and graduate Management Information Systems courses.\n\nLaudon and Laudon continue to define the MIS course with their latest comprehensive text.\n\nManagement Information Systems provides comprehensive and integrative coverage of essential new technologies, information system applications, and their impact on business models and managerial decision making in an exciting and interactive manner. \n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (917, '0132971216', '9780132971218', 'Information Systems Today', 2014, 6, 1, 1, 3, '8-1/2\" x 10-7/8\"', '566', '2013-01-04 00:00:00', 'For undergraduate Introduction to Management Information Systems courses.  \n\nBring current, real-world IS concepts into your classroom. \n\nOne of the greatest challenges in teaching IS courses is keeping pace with what’s happening in the real-world. Information Systems Today shows students how information technology and systems are continuing to expand within all aspects of today’s organizations and society.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (918, '0132993341', '9780132993340', 'Fundamentals of Futures and Options Markets', 2014, 5, 1, 1, 2, '8\" x 10\"', '576', '2013-01-04 00:00:00', 'For undergraduate courses in derivatives, options and futures, financial engineering, financial mathematics, and risk management.\n\nA reader-friendly book with an abundance of numerical and real-life examples.\n\nBased on Hull\'s Options, Futures and Other Derivatives, Fundamentals of Futures and Options Markets presents an accessible and student-friendly overview of the topic without the use of calculus. Packed with numerical examples and accounts of real-life situations, this text effectively guides students through the material while helping them prepare for the working world.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (919, '0132970759', '9780132970754', 'MIS Essentials', 2014, 6, 1, 1, 3, '8-1/2\" x 10-7/8\"', '374', '2013-01-07 00:00:00', 'For undergraduate courses in Management Information Systems\n\nWhy is MIS the most important course in the business school, and MIS Essentials the most important book in your students’ backpack? \n\nTogether, they show students exactly how businesses use information systems and technology to accomplish their goals, objectives, and competitive strategy. Knowing this helps students get ahead of the IS curve, which in turn, will keep them ahead of the growing list of obsolete jobs. MyMISLab further prepares students for the rigors of the workplace through additional study material, quizzing, and testing, and also engages students in real business situations through simulations. \n\nThe Third Edition focuses on the latest innovation in MIS and addresses today’s changing student experience through new Guides and new GearUp and PRIDE cases, based on real businesses and business opportunities.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (920, '0132971321', '9780132971324', 'Business Communication Essentials', 2014, 8, 1, 1, 3, '8-1/2\" x 10-7/8\"', '494', '2013-01-07 00:00:00', 'For Business Communication courses. \n\nPrepare students for the demands they’ll face on the job. \n\nOnly Bovée/Thill texts thoroughly address the new-media skills that employees are expected to have in today’s business environment. Business Communication Essentials presents these technologies in the context of proven communication strategies and essential business English skills.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (921, '0132846918', '9780132846912', 'Digital Business Networks', 2014, 6, 1, 1, 3, '8\" x 10\"', '500', '2013-01-07 00:00:00', 'For courses in Data Communications and Networking\n \nWireless technologies and social networking applications are dramatically transforming data communications. To keep readers aware of these rapid changes, Digital Business Networks explores emerging technologies, such as 4G mobile wireless, the advent of social networking applications from a business perspective, the underlying layer architecture functionalities of the TCP/IP model, and IPv6.  The running theme of the discussion is cloud architectures, and the way they impact businesses’ networking capability.\n \nTeaching and Learning Experience\nTo provide a better teaching and learning experience, for both instructors and students, this program will:\nEngage Students: Activities and a running case study offer a real-world perspective that helps students connect what they are learning with how it will be applied in a business setting.\nApply Theory and/or Research: This text explores the current theories and research associated with the emerging technologies associated with digital business networks.\nSupport Instructors and Students: End-of-chapter student resources and instructor materials supplement the text, and extend learning both inside, and outside, of the classroom.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (922, '0133043606', '9780133043600', 'Management', 2014, 31, 1, 1, 2, '8-1/2\" x 10-7/8\"', '672', '2013-01-07 00:00:00', 'For Principles of Management courses.\n\nREAL Managers, REAL Experiences: Bring management theories to life! \n\nThis bestselling principles text vividly illustrates management theories by incorporating the perspectives of real-life managers. Throughout this text, students will see and experience management in action, helping them understand how the concepts they’re reading about work in today’s business world.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (923, '0133058360', '9780133058369', 'Guide to Presentations', 2014, 8, 1, 1, 3, '5-1/2\" x 8\"', '150', '2013-01-08 00:00:00', 'For anyone who has to make presentations.\n\nA brief, professional, reader-friendly guide to creating effective presentations. \n\nMany people avoid giving presentations or simply suffer through them. Guide to Presentations, with its clear, concise, and practical information, helps readers understand how to prepare and practice in order to make presentations far less troubling.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (924, '0133022927', '9780133022926', 'The Economics of Sports', 2014, 29, 1, 1, 2, '7-3/8\" x 9-1/8\"', '496', '2013-01-08 00:00:00', 'For undergraduate courses in sports economics.\n\nCore economic concepts developed through examples from the sports industry.\n\nThe sports industry provides a seemingly endless set of examples from every area of microeconomics, giving students the opportunity to study economics in a context that holds their interest. The Economics of Sports explores economic concepts and theory—industrial organization, public finance, and labor economics—in the context of applications and examples from American and international sports.\n\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (925, '013297133X', '9780132971331', 'Guide to Managerial Communication', 2014, 8, 1, 1, 3, '5-1/2\" x 8\"', '210', '2013-01-08 00:00:00', 'For undergraduate and MBA courses in Management Communication, Writing, and Oral Presentations. Also a useful reference for Executive Seminars/Workshops.\n\nA brief, professional, reader-friendly guide to improving managerial communication.\n\nGuide to Managerial Communication is a clear, concise, practical text for cultivating effective written and oral communication in a managerial, business, government, or professional context.', 0);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (926, '0133075281', '9780133075281', 'Environmental Law', 2014, 4, 1, 1, 3, '7\" x 9-1/8\"', '480', '2013-01-08 00:00:00', 'For undergraduate/graduate-level courses in Environmental Law and Environmental Policy.\n\nAn introduction to environmental law for \"non-law\" students.\n\nEnvironmental Law is designed to introduce those without any legal or special scientific training to the system through which the nation attempts to preserve and protect the different aspects of our environment.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (927, '0133062120', '9780133062120', 'International Management: Text and Cases', 2014, 31, 1, 1, 2, '8-1/2\" x 10-7/8\"', '470', '2013-01-09 00:00:00', 'For undergraduate and graduate students majoring in international business or general management.\n\nAn exploration of the issues facing international business managers today.\n\nInternational Management explores the dynamic global environment of business management by exploring the political, legal, technological, competitive, and cultural factors that shape corporations worldwide.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (928, '0133043541', '9780133043549', 'Human Resource Management', 2014, 31, 1, 1, 3, '8-1/2\" x 10-7/8\"', '436', '2013-01-09 00:00:00', 'For undergraduate courses in Human Resources Management.\n\nThe most student accessible HRM text on the market! \n\nThere is no greater asset to a company than its employees–which is why Human Resource Management shows readers how to maximize a firm’s potential through identifying and keeping an ideal workforce.  \n\nThis text is intended primarily for the first undergraduate course in human resource management or for students who are being exposed to human resource management for the first time. The text is designed to introduce them to the field through the use of numerous examples and company material and will reinforce the notion that, by definition, all managers are necessarily involved with human resources.\n\nThe new edition reflects many recent changes in the industry, across the country, and around the globe, including the 2012 national elections, continuing economic uncertainly, technological changes including an increase in mobile recruiting and learning, and the integral role that social media tools such as wikis, blogs, LinkedIn, Facebook, and Twitter now play in the field of HR.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (929, '0133084043', '9780133084047', 'Principles of Marketing', 2014, 7, 1, 1, 2, '8-1/2\" x 10-7/8\"', '744', '2013-01-09 00:00:00', 'For courses in Principles of Marketing using a comprehensive text\n\nHelp students learn how to create value and gain loyal customers.\n \nPrinciples of Marketing helps students master today’s key marketing challenge: to create vibrant, interactive communities of consumers who make products and brands a part of their daily lives. Presenting fundamental marketing information within an innovative customer-value framework, the program helps students understand how to create value and gain loyal customers. \n\nThe fifteenth edition has been thoroughly revised to reflect the major trends and forces impacting marketing in this era of customer value and high-tech customer relationships. Emphasizing the great role that technology plays in contemporary marketing, it’s packed with new stories and examples illustrating how companies employ technology to gain competitive advantage–from traditional marketing all-stars such as P&G and McDonald’s to new-age digital competitors such as Apple and Google. \n\nNewly available with the fifteenth edition, the new design MyMarketingLab’s hands-on activities and exercises enable students to better understand and master the course’s core concepts–and the skills required to be successful marketers today.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (930, '0132948877', '9780132948876', 'Macroeconomics', 2014, 17, 1, 1, 3, '8-1/2\" x 10-7/8\"', '480', '2013-01-09 00:00:00', 'For Principles of Macroeconomics courses. \n\nQuestions that drive interest, applications that illustrate concepts, and the tools to test and solidify comprehension. \n\nStudents come into their first Economics course thinking they will gain a better understanding of the economy around them. Unfortunately, they often leave with many unanswered questions. To ensure students actively internalize economics, O\'Sullivan/Sheffrin/Perez use chapter-opening questions to spark interest on important economic concepts, applications that vividly illustrate those concepts, and chapter-ending tools that test and solidify understanding.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (931, '0133059510', '9780133059519', 'Business Communication', 2014, 8, 1, 1, 3, '9\" x 10-7/8\"', '575', '2013-01-09 00:00:00', 'For courses in Business Communication.\n\nPolishing your professional presence.\n \nStudents’ career success depends on their ability to be professional, adaptable, and strategic about their communication choices. By providing concise, student-centered information on how to develop a strong foundation in business communication, Business Communication: Polishing Your Professional Presence helps students enhance their professional and personal success.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (932, '0132994879', '9780132994873', 'Foundations of Finance', 2014, 5, 1, 1, 2, '8-1/2\" x 10-7/8\"', '552', '2013-01-09 00:00:00', 'Motivate your students to study finance by focusing on its five underlying principles.\n\nFoundations of Finance enables students to see the big picture by helping them understand the logic that drives finance rather than having them memorize formulas. ', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (933, '0132948907', '9780132948906', 'Economics Today', 2014, 16, 1, 1, 2, '8-1/2\" x 10-7/8\"', '960', '2013-01-10 00:00:00', 'Economics Today—Bringing the Real World to Your Students \n\nStudents learn best when they see concepts applied to examples from their everyday lives. This new edition of Economics Today covers leading-edge issues while lowering barriers to student learning. The text relentlessly pursues the fundamental objective of showing students how economics is front and center in their own lives while providing them with many ways to evaluate their understanding of key concepts covered in each chapter.\n \nEach chapter begins and ends with an Issues and Applications feature, which introduces a timely issue in the chapter opener and analyzes the issue using the economic tools learned in that chapter at the end. This text is also available with MyEconLab®, which includes assessment questions that tie to these Issues and Applications, as well as ABC News video clips. With MyEconLab, students can continue working problems online and receive personalized tutorial resources. Visit MyEconLab for more information.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (934, '0132948893', '9780132948890', 'Economics Today: The Macro View', 2014, 17, 1, 1, 3, '8-1/2\" x 10-7/8\"', '624', '2013-01-10 00:00:00', 'Economics Today—Bringing the Real World to Your Students \n\nStudents learn best when they see concepts applied to examples from their everyday lives. This new edition of Economics Today: The Macro View covers leading-edge issues while lowering barriers to student learning. The text relentlessly pursues the fundamental objective of showing students how economics is front and center in their own lives while providing them with many ways to evaluate their understanding of key concepts covered in each chapter.\n \nEach chapter begins and ends with an Issues and Applications feature, which introduces a timely issue in the chapter opener and analyzes the issue using the economic tools learned in that chapter at the end. This text is also available with MyEconLab®, which includes assessment questions that tie to these Issues and Applications, as well as ABC News video clips. With MyEconLab, students can continue working problems online and receive personalized tutorial resources. Visit MyEconLab for more information.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (935, '0132948885', '9780132948883', 'Economics Today: The Micro View', 2014, 18, 1, 1, 3, '8-1/2\" x 10-7/8\"', '624', '2013-01-10 00:00:00', 'Economics Today—Bringing the Real World to Your Students \n\nStudents learn best when they see concepts applied to examples from their everyday lives. This new edition of Economics Today: The Micro View covers leading-edge issues while lowering barriers to student learning. The text relentlessly pursues the fundamental objective of showing students how economics is front and center in their own lives while providing them with many ways to evaluate their understanding of key concepts covered in each chapter.\n \nEach chapter begins and ends with an Issues and Applications feature, which introduces a timely issue in the chapter opener and analyzes the issue using the economic tools learned in that chapter at the end. This text is also available with MyEconLab®, which includes assessment questions that tie to these Issues and Applications, as well as ABC News video clips. With MyEconLab, students can continue working problems online and receive personalized tutorial resources. Visit MyEconLab for more information.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (936, '0133023443', '9780133023442', 'Systems Analysis and Design', 2014, 6, 1, 1, 2, '8-1/2\" x 10-7/8\"', '590', '2013-01-11 00:00:00', 'For undergraduate systems analysis and design courses.\n\nKendall and Kendall’s Systems Analysis and Design, Ninth Edition, is a human-centered book that concisely presents the latest systems development methods, tools, and techniques to students in an engaging and easy-to-understand manner.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (937, '0133423905', '9780133423907', 'Microeconomics', 2014, 18, 1, 1, 3, '8-1/2\" x 10-7/8\"', '552', '2013-01-14 00:00:00', 'Get students to think like an Economist using the latest policy and data while incorporating global issues\n\nThoroughly updated, stripped of technical detail where possible, extensively illustrated with well-chosen photographs, enlivened with new applications features that focus on issues at play in today’s world, responsive to the suggestions of reviewers and users, and seamlessly integrated with MyEconLab: These are the hallmarks of this eleventh edition of Microeconomics.\n \nParkin brings critical issues to the forefront. Each chapter begins with one of today’s key issues, and additional issues appear throughout the chapter to show the real-world applications of the theory being discussed. When the chapter concludes, students “read between the lines” to think critically about a news article relating to the issue, demonstrating how thinking like an economist can bring a clearer perspective to and deeper understanding of today’s events. Students will begin to think about issues the way real economists do and learn how to explore difficult policy problems and make more informed decisions in their own economic lives.\n \nParkin is so committed to currency that he uploads news articles almost daily to MyEconLab®, the online assessment and tutorial system that accompanies the text. Assessment questions based on the Economics in the News articles are uploaded periodically so that instructors can assign recent articles within MyEconLab.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (938, '0133019934', '9780133019933', 'Microeconomics: Theory and Applications with Calculus', 2014, 18, 1, 1, 2, '8\" x 10\"', '800', '2013-01-15 00:00:00', 'For all intermediate Microeconomics courses at the undergraduate or graduate level.\n\nUnderstand the practical, problem-solving aspects of microeconomic theory. \n\nMicroeconomics: Theory and Applications with Calculus uses calculus, algebra, and graphs to present microeconomic theory using actual examples, and then encourages students to apply the theory to analyze real-world problems. \n\nThe Third Edition has been substantially revised, 80% of the Applications are new or updated, and there are 24 new Solved Problems. Every chapter (after Chapter 1) contains a new feature (the Challenge and the Challenge Solution) and has many new end-of-chapter exercises. ', 0);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (939, '0133020258', '9780133020250', 'Macroeconomics', 2014, 17, 1, 1, 3, '8-1/2\" x 10-7/8\"', '464', '2013-01-17 00:00:00', '&>Get students to think like an Economist using the latest policy and data while incorporating global issues\nThoroughly updated, stripped of technical detail where possible, extensively illustrated with well-chosen photographs, enlivened with new applications features that focus on issues at play in today’s world, responsive to the suggestions of reviewers and users, and seamlessly integrated with MyEconLab: These are the hallmarks of this eleventh edition of Economics.\n \nParkin brings critical issues to the forefront. Each chapter begins with one of today’s key issues, and additional issues appear throughout the chapter to show the real-world applications of the theory being discussed. When the chapter concludes, students “read between the lines” to think critically about a news article relating to the issue, demonstrating how thinking like an economist can bring a clearer perspective to and deeper understanding of today’s events. Students will begin to think about issues the way real economists do and learn how to explore difficult policy problems and make more informed decisions in their own economic lives.\n \nParkin is so committed to currency that he uploads news articles almost daily to MyEconLab®, the online assessment and tutorial system that accompanies the text. Assessment questions based on the Economics in the News articles are uploaded periodically so that instructors can assign recent articles within MyEconLab.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (940, '0132948869', '9780132948869', 'Microeconomics', 2014, 18, 1, 1, 3, '8-1/2\" x 10-7/8\"', '480', '2013-01-22 00:00:00', 'For Principles of Microeconomics courses. \n\nQuestions that drive interest, applications that illustrate concepts, and the tools to test and solidify comprehension. \n\nStudents come into their first Economics course thinking they will gain a better understanding of the economy around them. Unfortunately, they often leave with many unanswered questions. To ensure students actively internalize economics, O\'Sullivan/Sheffrin/Perez use chapter-opening questions to spark interest on important economic concepts, applications that vividly illustrate those concepts, and chapter-ending tools that test and solidify understanding.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (942, '0133075222', '9780133075229', 'Employment Law', 2014, 4, 1, 1, 2, '8-1/2\" x 10-7/8\"', '552', '2013-01-23 00:00:00', 'For courses in Employment Law, Labor Law, and Human Resource Management.\n\nSee the principles of law through real-world applications.  \n\nMoran approaches employment law with a focus on discrimination and employment regulation, presenting the principles of law in a logical succession and illustrating those principles with engaging real-world applications.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (943, '0132991306', '9780132991308', 'Modern Systems Analysis and Design', 2014, 6, 1, 1, 2, '8-1/2\" x 10-7/8\"', '566', '2013-01-27 00:00:00', 'For undergraduate and graduate systems analysis and design courses.\n \nModern Systems Analysis and Design uses a practical, rather than technical, approach to help students learn the methods and principles of systems development. This text covers the concepts, skills, methodologies, techniques, tools, and perspectives essential for systems analysts to successfully develop information systems. \n  \nTeaching and Learning Experience\nThis program will provide a better teaching and learning experience—for you and your students. It provides:\nFully Engaged Students: Three fictional cases illustrate connections.\nA Clear Understanding of Systems Development: The authors use the systems development life cycle (SDLC) model as an organizing tool throughout the text.\nBetter Critical Thinking: A traditional, linear approach to teaching systems analysis and design. \n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (944, '0132968363', '9780132968362', 'Principles of Operations Management', 2014, 31, 1, 1, 3, '8-1/2\" x 10-7/8\"', '700', '2013-01-29 00:00:00', 'For Operations Management courses.\n\nA broad, practical introduction to operations, reinforced with an extensive collection of practice problems. \n\nPrinciples of Operations Management presents a broad introduction to the field of operations in a realistic and practical manner, while offering the largest and most diverse collection of problems on the market. The problems found in this text also contain ample support—found in the book’s solved-problems, worked examples, and myomlab, Pearson’s new online homework and tutorial system—to help students complete and understand assignments even when they’re not in class.  \n\nFor a more comprehensive version with the business analytic modules at the end of the text, see Heizer/Render’s Operations Management, 11e. ', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (946, '0133125637', '9780133125634', 'Auditing and Assurance Services', 2014, 30, 1, 1, 2, '8-1/2\" x 10-7/8\"', '872', '2013-01-29 00:00:00', 'For the core auditing course for accounting majors. \n\nAn integrated and current approach to auditing.\n\nAuditing and Assurance Services: An Integrated Approach presents an integrated concepts approach that shows students the auditing process from start to finish. This text prepares students for real-world audit decision making by using illustrative examples of key audit decisions, with an emphasis on audit planning, risk assessment processes and collecting and evaluating evidence in response to risks.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (947, '0132921146', '9780132921145', 'Operations Management', 2014, 31, 1, 1, 2, '8-1/2\" x 10-7/8\"', '870', '2013-01-30 00:00:00', 'For Operations Management courses.\n\nA broad, practical introduction to operations, reinforced with an extensive collection of practice problems. \n\nOperations Management presents a broad introduction to the field of operations in a realistic and practical manner, while offering the largest and most diverse collection of problems on the market. The problems found in this text also contain ample support—found in the book’s solved-problems, worked examples, and myomlab, Pearson’s new online homework and tutorial system—to help students complete and understand assignments even when they’re not in class.  \n\nFor a briefer version without the business analytic modules at the end of the text, see Heizer/Render’s Principles of Operations Management: Sustainability and Supply Chain Management, 9e.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (948, '0133126242', '9780133126242', 'Integrated Advertising, Promotion, and Marketing Communications', 2014, 7, 1, 1, 3, '8-1/2\" x 10-7/8\"', '464', '2013-02-04 00:00:00', 'For undergraduate Advertising and Integrated Marketing Communication courses.\n \nExamine advertising and promotions through the lens of integrated marketing communications.\n \nThe carefully integrated approach of this text blends advertising, promotions, and marketing communications together, providing students with the information they need to understand the process and benefits of successful IMC campaigns.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (949, '0132992280', '9780132992282', 'Macroeconomics', 2014, 17, 1, 1, 2, '8\" x 10\"', '672', '2013-02-04 00:00:00', 'Abel, Bernanke, and Croushore present macroeconomic theory in a way that prepares students to analyze real macroeconomic data used by policy makers and researchers. With a balanced treatment of both classical and Keynesian economics, the comprehensive coverage makes it easy for instructors to align chapters to fit their own syllabi.\n\nStudents in this course often struggle to see how the macroeconomic models compare to one another, and fit into the big picture. This text uses a unified approach based on a single economics model that provides students with a clear understanding of macroeconomics and its classical and Keynesian assumptions.\n \nThe main objective of the eighth edition is to keep the book fresh and up-to-date, especially in light of the recent crises in the United States and Europe and many new tools used by the Federal Reserve in response to the crisis. To reflect recent events and developments in the field, revisions have been made throughout the text, and additional new applications, boxes, and problems are included.\n \nAvailable with the award-winning MyEconLab!\nMyEconLab is a powerful assessment and tutorial system that works hand-in-hand with Macroeconomics. MyEconLab includes comprehensive homework, quiz, test, and tutorial options, where instructors can manage all assessment needs in one program! \n \nNote: If you are purchasing the standalone text (ISBN: 0132992280) or electronic version, MyEconLab does not come automatically packaged with the text. To purchase MyEconLab, please visit: www.myeconlab.com or you can purchase a package of the physical text + MyEconLab by searching the Pearson Higher Education web site. MyEconLab is not a self-paced technology and should only be purchased when required by an instructor.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (950, '0132994917', '9780132994910', 'Money, Banking, and the Financial System', 2014, 16, 1, 1, 2, '8\" x 10\"', '650', '2013-02-04 00:00:00', 'Make the link between theory and real-world easier for students with the most up-to-date Money and Banking text on the market today! \n \nHubbard/O\'Brien\'s textbook presents Money, Banking, and the Financial System in the context of contemporary events, policy, and business with an integrated explanation of today’s financial crisis.  Reviewers tell us that Hubbard/O\'Brien helps make the link between theory and real-world easier for students!\n\nThe second edition retains the modern approach of the first edition, while incorporating several changes to address feedback from instructors and students and also to reflect the authors’ own classroom experiences.\n\nAvailable with MyEconLab! \nMyEconLab is a powerful assessment and tutorial system that works hand-in-hand with Money and Banking. MyEconLab includes comprehensive homework, quiz, test, and tutorial options, where instructors can manage all assessment needs in one program.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (951, '0132992477', '9780132992473', 'Corporate Finance', 2014, 5, 1, 1, 2, '8\" x 10\"', '1,104', '2013-02-06 00:00:00', 'For MBA/graduate students taking a course in corporate finance.\n\nUsing the unifying valuation framework based on the Law of One Price, top researchers Jonathan Berk and Peter DeMarzo set the new standard for corporate finance textbooks. Corporate Finance blends coverage of time-tested principles and the latest advancements with the practical perspective of the financial manager. With this ideal melding of the core with modern topics, innovation with proven pedagogy, Berk and DeMarzo establish the new canon in finance.\n \nFor programs and professors who would like a streamlined book that is specifically tailored to the topics covered in the first one-semester course, Corporate Finance: The Core is also available by Jonathan Berk and Peter DeMarzo.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (952, '0133097897', '9780133097894', 'Corporate Finance, The Core', 2014, 5, 1, 1, 2, '8\" x 10\"', '736', '2013-02-06 00:00:00', 'For MBA/graduate students taking a course in corporate finance.\n\nBerk and DeMarzo\'s Corporate Finance uses a unifying valuation framework, the Law Of One Price, to present the core content instructors expect, the new ideas they want, and the pedagogy their students need to succeed. \n \nCorporate Finance: The Core fits programs and individual professors who desire a streamlined book that is specifically tailored to the topics covered in the first one-semester course. For programs and professors who would like to use a text in a two semester, or more, sequence, please see Corporate Finance, the 31 chapter book also by Jonathan Berk and Peter DeMarzo.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (953, '0132991322', '9780132991322', 'Accounting Information Systems: The Crossroads of Accounting and IT 2e', 2014, 30, 1, 1, 2, '8-1/2\" x 10-7/8\"', '550', '2013-02-14 00:00:00', 'For courses in Accounting Information Systems.\n \nNavigate the crossroads of accounting and IT.\n \nKay/Ovlia is designed to assist students’ journey as they explore the crossroads of accounting and IT—the very place where they’ll learn how to gain a competitive edge in the accounting field. To help them on their journey, this text presents information on how to develop communication, leadership, strategic and critical thinking, a customer focus, an interpretation of converging information, and technological skills.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (954, '0132948850', '9780132948852', 'Survey of Economics', 2014, 16, 1, 1, 3, '8-1/2\" x 10-7/8\"', '480', '2013-02-26 00:00:00', 'For one semester Principles of Economics courses. \n\nQuestions that drive interest, applications that illustrate concepts, and the tools to test and solidify comprehension. \n \nStudents come into their first Economics course thinking they will gain a better understanding of the economy around them. Unfortunately, they often leave with many unanswered questions. To ensure students actively internalize economics, O\'Sullivan/Sheffrin/Perez use chapter-opening questions to spark interest on important economic concepts, applications that vividly illustrate those concepts, and chapter-ending tools that test and solidify understanding.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (955, '0133251241', '9780133251241', 'Horngren\'s Financial & Managerial Accounting', 2014, 30, 1, 1, 2, '9\" x 10-7/8\"', '1,450', '2013-02-26 00:00:00', 'For courses in Financial and Managerial Accounting\n\n\nRedefining tradition in the accounting course.\n\nThe fourth edition of Horngren’s Financial and Managerial Accounting presents the core content of the accounting course in a fresh format designed to help today’s learners succeed. \n\nBuilt upon the foundation of the Horngren franchise, this new edition was created by an all-new author team who sought to bridge the gap between textbook content and classroom instruction techniques. New pedagogical features such as Instructor Tips & Tricks and Common Questions, Answered walk students through the material as a great instructor would, fostering deeper understanding of accounting theory and practice. \n\nThe table of contents for the fourth edition has been significantly overhauled to match the way the contemporary course is often taught. Additionally, the whole text has been put through a rigorous accuracy check, so instructors can be confident that it is up-to-date and error-free. And thorough integration between the text and MyAccountingLab places practice opportunities just a few clicks away–and provides a truly interactive learning experience.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (956, '0133251969', '9780133251968', 'Comprehensive Assurance & Systems Tool (CAST): An Integrated Practice Set', 2014, 30, 1, 1, 3, '8-1/2\" x 10-7/8\"', '384', '2013-02-27 00:00:00', 'Comprehensive Assurance and Systems Tool (CAST) provides an integrated learning opportunity that encompasses financial statement assurance and accounting information systems.  CAST uniquely exposes students to these issues at The Winery at Chateau Americana, a hypothetical company that is based on an actual domestic winery.  Unlike traditional projects and assignments that may offer little or no context, students develop a rich knowledge and understanding of Chateau Americana and its industry as they provide assurance on the company’s financial statements and address a variety of challenging accounting information systems issues.\n \nThe third edition has been updated in response to the changes that have occurred in the accounting environment, in technology, and in response to the many helpful comments and suggestions we have received from adopters and students alike.\n \nSpecifically, the authors have incorporated new transactions in the Manual Module that are intended to reinforce more advanced accounting transaction processing.\n \nIn the Computerized AIS Module, the authors have provided more advanced Macro instruction and additional PivotTable practice. \n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (957, '0132992914', '9780132992916', 'Principles of Risk Management and Insurance', 2014, 5, 1, 1, 2, '8\" x 10\"', '748', '2013-02-27 00:00:00', 'For undergraduate courses in Risk Management and Insurance.\n\nComplete and current coverage of major risk management and insurance topics. \n\nPrinciples of Risk Management and Insurance is the market-leading text for this course, ideal for undergraduate courses and students from a mix of academic majors. Focusing primarily on the consumers of insurance, this text blends basic risk management and insurance principles with consumer considerations.\n\nThe twelfth edition provides an in-depth treatment of major risk management and insurance topics. Coverage includes a discussion of basic concepts of risk and insurance, introductory and advanced topics in risk management, functional and financial operations of insurers, legal principles, life and health insurance, property and liability insurance, employee benefits, and social insurance. In addition, the new Affordable Care Act is discussed in depth.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (958, '0132991330', '9780132991339', 'Macroeconomics', 2014, 17, 1, 1, 2, '7-3/8\" x 9-1/8\"', '720', '2013-02-28 00:00:00', 'For undergraduate Macroeconomics courses.\n\nA modern approach to macroeconomics. \n\nWilliamson’s Macroeconomics uses a thoroughly modern approach by showing students how to build macroeconomic models from microeconomic principles. This approach helps to make the text consistent with the way macroeconomic research is conducted today.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (959, '0133251039', '9780133251036', 'Introduction to Financial Accounting', 2014, 30, 1, 1, 2, '8-1/2\" x 10-7/8\"', '646', '2013-03-11 00:00:00', 'For Introductory Financial Accounting courses at the MBA level, and for rigorous undergraduate courses. \n\nA unique blend of theory, practice, and robust financial statement analysis.\n\nIntroduction to Financial Accounting describes the most widely accepted accounting theory and practice with an emphasis on using and analyzing the information in financial statements. This text also compares U.S. GAAP to IFRS where relevant.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (960, '0133056252', '9780133056259', 'Customer Service: Career Success through Customer Loyalty', 2014, 7, 1, 4, 3, '8\" x 10\"', '280', '2013-04-05 00:00:00', 'For courses in Customer Service.\n \nCustomer Service: Career Success through Customer Loyalty, 6e provides a systematic process for building service skills that all business people need. Presented in a friendly, conversational manner, the text is filled with examples that demonstrate the link between service skills and career achievement. This edition features more on social networking,  trustability, and customer service trends. Information is also included on internal customers, emerging technologies, and stress-reducing techniques. Throughout the text, there is an emphasis on transforming good service intentions into a workable plan that yields loyalty and success.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (964, '0133083578', '9780133083576', 'The Practice of Public Relations', 2014, 7, 1, 4, 3, '8\" x 10\"', '480', '2013-05-01 00:00:00', 'For undergraduate Introduction to Public Relations courses.\n\nPairing Fraser Seitel’s unique, humorous voice with the most up-to-date case studies, interviews, news photos, and other techniques, the Practice of Public Relations is truly an “in-your-face” Public Relations textbook. \n\nThe 12th edition continues the theme of giving students the knowledge and skills they need to know to be successful in today’s world of public relations –including heavy emphasis on social media and ethics.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (965, '0133023354', '9780133023350', 'QuickBooks Pro 2013: A Complete Course', 2014, 30, 1, 4, 3, '8-1/2\" x 10-7/8\"', '800', '2013-05-01 00:00:00', 'For a one-term course in microcomputer accounting. No prior knowledge of or experience with computers, Windows, or QuickBooks is required; however, an understanding of accounting is essential to successful completion of the coursework.\n\nDesigned to present accounting concepts and their relationship to QuickBooks® 2013, this text uses a fictitious company to provide hands-on training while it introduces major accounting concepts. \n\nQuickBooks® 2013: A Complete Course is a comprehensive instructional learning resource. The text provides training using the QuickBooks® Premier Accountant 2013 accounting program (for simplicity, the program is referred to as QuickBooks 2013 throughout the text). Even though the text was written using the 2013 Accountants version of QuickBooks Premier, it may be used with the Pro version of the program as well. (Because of the many differences between the Windows and Mac versions of QuickBooks, this text should not be used for training using QuickBooks for the Mac.)\n\nThis edition reflects the latest version of QuickBooks along with several changes, enhancements, and new features.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (967, '013302380X', '9780133023800', 'Principles of Economics', 2014, 16, 1, 4, 2, '8-1/2\" x 10-7/8\"', '816', '2013-05-31 00:00:00', 'For the 2-semester principles of economics course.\n\nReviewers tell us that Case/Fair/Oster is one of the all-time bestselling POE texts because they trust it to be clear, thorough and complete.   Case/Fair/Oster readers also come away with a basic understanding of how market economies function, an appreciation for the things they do well, and a sense of things they do poorly.  Readers begin to learn the art and science of economic thinking and begin to look at some policy and even personal decisions in a different way.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (968, '0133024164', '9780133024166', 'Principles of Microeconomics', 2014, 18, 1, 4, 3, '8-1/2\" x 10-7/8\"', '528', '2013-05-31 00:00:00', 'For the one semester principles of microeconomics course.\n\nReviewers tell us that Case/Fair is one of the all-time bestselling POE texts because they trust it to be clear, thorough and complete. \n ', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (969, '013606552X', '9780136065524', 'Economics for Managers', 2010, 16, 1, 4, 2, '8-1/2\" x 10-7/8\"', '592', '2013-06-14 00:00:00', 'For one semester MBA Managerial Economics courses\n \nEconomics for Managers presents the fundamental ideas of microeconomics and macroeconomics and integrates them from a managerial decision-making perspective in a framework that can be used in a single-semester course.\n \nTo be competitive in today’s business environment, managers must understand how economic forces affect their business and the factors that must be considered when making business decisions.  This is the only book that provides business students and MBAs with a thorough and applied understanding of both micro- and macroeconomic concepts in a way non-economics majors can understand. \n \nThe third edition retains all the same core concepts and straightforward material on micro- and macroeconomics while incorporating new case material and real-world examples that relate to today’s managerial student.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (970, '0132147556', '9780132147552', 'E-Marketing', 2012, 7, 1, 4, 3, '7\" x 9-1/8\"', '438', '2013-07-01 00:00:00', 'For courses in Internet Marketing or E-marketing\n\nThis book teaches marketers how to engage and listen to buyers, and how to use what they learn to improve their offerings in today’s Internet- and social media-driven marketing environment. It brings traditional marketing coverage up-to-date with a thorough, incisive look at e-marketing planning and marketing mix tactics from a strategic and tactical perspective. The focus is on the Internet and other technologies that have had a profound effect on how marketing is approached today. Included is coverage of marketing planning; legal and global environments; e-marketing strategy; and marketing mix and customer relationship management strategy and implementation issues.\n \nA major revision, this Seventh Edition reflects the disruption to the marketing field brought about by social media. As such it covers many new topics that represent the changes in e-marketing practice in the past two years. Because of the ever-changing landscape of the Internet, the authors suggest reading this book, studying the material, and then going online to learn more about topics of interest.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (972, '0136090036', '9780136090038', 'Making the Team', 2011, 31, 1, 4, 3, '7\" x 9-1/8\"', '470', '2013-07-10 00:00:00', 'For undergraduate or graduate management courses in Organization Behavior, Group Dynamics, or Teamwork; also appropriate for executives enrolled in degree and non-degree short courses on general management.\n\nGain inside insight to help team leaders and team members maximize their success in business. \n\nMaking the Team: A Guide for Managers combines cutting-edge theory with the latest research and real-world applications in order to help team leaders and team members succeed in the business world. \n\nEvery chapter of this edition contains new information, new research, updated examples, and more.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (973, '0136039855', '9780136039853', 'The Economic Way of Thinking', 2010, 16, 1, 4, 3, '7-3/8\" x 9-1/8\"', '575', '2013-07-12 00:00:00', 'For one semester survey courses in general economics\n \nTeach your students how to think like economists.\n \nThe Economic Way of Thinking goes beyond explaining the basic principles of micro- and macroeconomic analysis by showing students a method of reasoning that teaches them how to apply these principles as tools. The authors expose students to a method of reasoning that makes them think like an economist through example and application and also shows them how not to think, by exposing errors in popular economic reasoning.\n \nThe latest edition has been thoroughly updated with current material.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (974, '0132991284', '9780132991285', 'The Economics of Macro Issues', 2014, 16, 1, 4, 3, '5-1/2\" x 8-1/2\"', '224', '2013-07-12 00:00:00', 'For principles of economics and social issues courses. \n\nBrief, relevant readings that spark independent thinking and classroom discussions.\n\nThe Economics of Macro Issues is a collection of brief, relevant readings that spark independent thinking and classroom discussions in Principles of Economics and Social Issues. The text encourages students to apply theoretical discussions to today’s important issues and to gain a deeper understanding of current macroeconomic policy concerns.\n\nThe Sixth Edition addresses critical new macroeconomic policy issues with timeliness and insight. It showcases pivotal developments in economic affairs and policymaking in ways that will provide both challenge and enlightenment to students at all levels of academic achievement.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (975, '0133022935', '9780133022933', 'The Economics of Public Issues', 2014, 16, 1, 4, 3, '5-1/2\" x 8-1/2\"', '256', '2013-07-12 00:00:00', 'For principles of economics, public policy, and social issues courses.\n\nBrief, relevant readings that spark independent thinking and classroom discussions.\n\nThe Economics of Public Issues is a collection of brief, relevant readings that spark independent thinking and classroom discussions in Principles of Economics and Social Issues courses. This text encourages students to apply theoretical discussions to today’s important issues and to gain a deeper understanding of current economic policy concerns.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (976, '0132992817', '9780132992817', 'The Economics of Women, Men and Work', 2014, 29, 1, 4, 3, '8\" x 10\"', '464', '2013-07-12 00:00:00', 'For courses found in Economics Departments and Departments of Women\'s Studies, on The Economics of Women, Women and Work, or the Economics of Gender.\n\nThe most current and comprehensive source available for research, data, and analysis on women, gender, and economics.\n\nBlau, Ferber, and Winkler are widely known for their research and contributions on the study of the economics of gender. As active researchers and leading scholars on the subject, the authors are in tune with the most current and relevant research that’s included in Economics of Women, Men, and Work.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (978, '0132145375', '9780132145374', 'Database Processing', 2012, 24, 1, 4, 2, '8-1/2\" x 10-7/8\"', '630', '2013-07-18 00:00:00', 'For undergraduate database management courses.\n\nGet students straight to the point of database processing.\n\nDatabase Processing reflects a new teaching method that gets students straight to the point with its thorough and modern presentation of database processing fundamentals.\n \nThe thirteenth edition has been thoroughly updated to reflect the latest software.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (979, '0321464486', '9780321464484', 'Development Economics', 2014, 29, 1, 4, 2, '8\" x 10\"', '760', '2013-07-19 00:00:00', 'About the Book\nGerard Roland’s new text, Development Economics, is the first undergraduate text to recognize the role of institutions in understanding development and growth. Through a series of chapters devoted to specific sets of institutions, Roland examines the effects of institutions on growth, property rights, market development, and the delivery of public goods and services and focuses. With the most comprehensive and up to date treatment of institutions on development, Roland explores the important questions of why some countries develop faster than others and why some fail while others are successful.\n \nRoland also introduces the latest research related to randomized program evaluation and how it can be used to evaluate different aid programs. What is the effect of de-worming drugs on school participation and learning? How effective are bed nets in fighting malaria? Program evaluation helps determine which programs are best, and which policies have the best ratio in achieving goals of health, education, welfare, and other measures of development. \n \nOrganized in three key parts, Roland begins by introducing the big issues of development. The second part gives a through treatment of the economics of institutions and why they matter, and the third analyzes development outcomes while building on the institutional framework introduced in part two.\n\n\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (980, '013610827X', '9780136108276', 'Hands-On Database', 2014, 24, 1, 4, 3, '8-1/2\" x 10-7/8\"', '224', '2013-08-15 00:00:00', 'For Introductory Database courses that focus on hands-on experience. \n\nDefine and develop a database through a scenario approach. \n\nHands-On Database uses a scenario-based approach that shows students how to build a database by providing them with the context of a running case throughout each step of the process.', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (981, '013610066X', '9780136100669', 'Business Intelligence', 2011, 6, 1, 2, 2, '8\" x 10\"', '770', '2013-09-15 00:00:00', 'Appropriate for all courses in Decision Support Systems (DSS), computerized decision making tools, and management support systems.\n\nDecision Support and Business Intelligence Systems 9e provides the only comprehensive, up-to-date guide to today\'s revolutionary management support system technologies, and showcases how they can be used for better decision-making.\n\nThe 10th edition focuses on Business Intelligence (BI) and analytics for enterprise decision support in a more streamlined book.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (983, '0132145383', '9780132145381', 'Electronic Commerce 2012', 2011, 6, 1, 2, 2, '8-1/2\" x 10-7/8\"', '782', '2013-10-15 00:00:00', 'For undergraduate and graduate electronic commerce courses.\n \nExplore the many aspects of electronic commerce through a managerial perspective.\n \nElectronic Commerce provides a thorough explanation of what EC is, how it’s being conducted and managed, and how to assess its opportunities, limitations, issues, and risks–all from a managerial perspective. By presenting EC through a managerial approach, this text makes the subject matter practical, relevant, and beneficial to majors and non-majors alike.\n \nTo keep pace with today’s ever-changing technology, the eighth edition has been streamlined–removing material that’s no longer relevant, while still providing students with information on the hottest topics in the field.\n', 1);
INSERT INTO `Books` (`ID`, `ISBN10`, `ISBN13`, `Title`, `CopyrightYear`, `SubcategoryID`, `ImprintID`, `ProductionStatusID`, `BindingTypeID`, `TrimSize`, `PageCountsEditorialEst`, `LatestInstockDate`, `Description`, `CoverImage`) VALUES (984, '0132730359', '9780132730358', 'E-Commerce 2013', 2012, 6, 1, 2, 2, '8\" x 10\"', '902', '2013-11-03 00:00:00', 'For the undergraduate and graduate e-commerce course in any business discipline.\n \nThe market-leading text for E-commerce. \n\nThis comprehensive, market-leading text emphasizes the three major driving forces behind E-commerce—technology change, business development, and social issues—to provide a coherent conceptual framework for understanding the field.\n \nThe tenth edition features updates to the text, data, figures, and tables based on the latest marketing and business intelligence available from eMarketer, Pew Internet & American Life Project, Forrester Research, comScore, Gartner Research, and other industry sources.  All opening, closing and “Insight on” cases are new or updated.', 1);
