INSERT INTO `GeoCountries` (`CountryCode`, `CountryName`, `Capital`, `GeoNameID`, `Area`, `Population`, `Continent`, `TopLevelDomain`, `CurrencyCode`, `CurrencyName`, `PhoneCountryCode`, `Languages`, `PostalCodeFormat`, `PostalCodeRegex`, `Neighbours`, `CountryDescription`) VALUES ('AD', 'Andorra', 'Andorra la Vella', 3041565, '468', 84000, 'EU', '.ad', 'EUR', 'Euro', '376', 'ca', 'AD###', '^(?:AD)*(\\d{3})$', 'ES,FR', 'Andorra is a landlocked microstate in Southwestern Europe, located in the eastern Pyrenees mountains and bordered by Spain and France. Its capital, Andorra la Vella, is the highest capital city in Europe, at an elevation of 1,023 metres (3,356 ft) above sea level. The official language is Catalan, although Spanish, Portuguese, and French are also commonly spoken.');
INSERT INTO `GeoCountries` (`CountryCode`, `CountryName`, `Capital`, `GeoNameID`, `Area`, `Population`, `Continent`, `TopLevelDomain`, `CurrencyCode`, `CurrencyName`, `PhoneCountryCode`, `Languages`, `PostalCodeFormat`, `PostalCodeRegex`, `Neighbours`, `CountryDescription`) VALUES ('AE', 'United Arab Emirates', 'Abu Dhabi', 290557, '82880', 4975593, 'AS', '.ae', 'AED', 'Dirham', '971', 'ar-AE,fa,en,hi,ur', NULL, NULL, 'SA,OM', 'The United Arab Emirates is an Arab country in the southeast of the Arabian Peninsula on the Persian Gulf, bordering Oman to the east and Saudi Arabia to the south, as well as sharing sea borders with Qatar and Iran. The UAE is a federation of seven emirates (equivalent to principalities), each governed by a hereditary emir, with a single national president. The constituent emirates are Abu Dhabi, Ajman, Dubai, Fujairah, Ras al-Khaimah, Sharjah, and Umm al-Quwain. The capital is Abu Dhabi, which is also the state\'s center of political, industrial, and cultural activities.');
